DROP TABLE IF EXISTS `collectible`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `collectible` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `graph_id` int(11) DEFAULT NULL,
  `collector_id` int(11) NOT NULL,
  `name` varchar(255) NOT NULL,
  `slug` varchar(128) DEFAULT NULL,
  `description` text NOT NULL,
  `num_comments` int(11) DEFAULT '0',
  `batch_hash` varchar(32) DEFAULT NULL,
  `score` int(11) DEFAULT '0',
  `is_name_automatic` tinyint(1) DEFAULT '0',
  `eblob` text,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `collectible_U_1` (`graph_id`),
  UNIQUE KEY `collectible_U_2` (`slug`),
  KEY `collectible_I_1` (`batch_hash`),
  KEY `collectible_FI_1` (`collector_id`),
  CONSTRAINT `collectible_FK_1` FOREIGN KEY (`collector_id`) REFERENCES `collector` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=5748 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;
LOCK TABLES `collectible` WRITE;
/*!40000 ALTER TABLE `collectible` DISABLE KEYS */;
INSERT  IGNORE INTO `collectible` (`id`, `graph_id`, `collector_id`, `name`, `slug`, `description`, `num_comments`, `batch_hash`, `score`, `is_name_automatic`, `eblob`, `created_at`, `updated_at`) VALUES (1,NULL,1,'GEM Razors voice-o-graph','gem-razors-voice-o-graph','This voice-o-graph was produced courtesy of GEM Razors for the armed forces, as a way of sending a vocal letter home to their families from basic training, ca. 1950s.',5,NULL,0,0,NULL,'2010-02-27 21:50:44','2011-11-10 07:24:11'),(2,NULL,1,'Voice-O-Graph mailer','voice-o-graph-mailer','Each voice-o-graph record produced would also come with a mailing envelope, for ease of mailing from one location to another. This one was send from Camp Kilmer in NJ to Springfield, OH, recounting the experiences of basic training.',0,NULL,0,0,NULL,'2010-02-27 05:03:28','2011-11-10 07:24:11'),(3,NULL,1,'Some Voice-O-Graphs from different eras','some-voice-o-graphs-from-different-eras','A sampling of different labels and mailers that were seen on the voice-o-graph between the 1940s and 1960s.',2,NULL,0,0,NULL,'2010-02-27 05:03:55','2011-11-10 07:24:11'),(4,NULL,1,'Voice-O-Graph from Pearl &amp; Chris, 1944','voice-o-graph-from-pearl-amp-chris-1944','A very clean example of a 1944 era Voice-O-Graph. I\'ve taken all of the voice-o-graphs that I\'ve collected and converted them to digital audio files for preservation.',0,NULL,0,0,NULL,'2010-02-27 05:03:50','2011-11-10 07:24:11'),(5,NULL,1,'Funniest Fan Letters to Batman book','funniest-fan-letters-to-batman-book','A great little paperback from the 1960s featuring a collection of letters written to Batman, both TV and comics versions.',0,NULL,0,0,NULL,'2010-02-15 23:04:25','2011-11-10 07:24:11'),(6,NULL,1,'Hot Wheels Batmobiles','hot-wheels-batmobiles','Two 2007 Hot Wheels Barris Batmobiles - the first time the 60s TV show Batmobile is in 1/64th scale! Short card and long car packaging variations included. Also have a loose one!',0,NULL,0,0,NULL,'2010-02-20 09:18:53','2011-11-10 07:24:11'),(7,NULL,1,'Matchbox Batmobile','matchbox-batmobile','An odd Matchbox \'Batmobile\' from the Matchbox Justice League Series (of 4) - pretty much a regular car with an Animated Batman slapped on it.',1,NULL,0,0,NULL,'2010-03-01 03:32:08','2011-11-10 07:24:11'),(8,NULL,1,'Corgi Batmobiles','corgi-batmobiles','A collection of Corgi 1/32 scale Batmobiles from different comic book eras - a wonderful exploration into the evolution of the Batmobile!',0,NULL,0,0,NULL,'2010-03-01 03:22:28','2011-11-10 07:24:11'),(9,NULL,1,'Other Batmobiles','other-batmobiles','Item on the left is a \'fantasy\' Batmobile, envisions by the Hot WHeels artists and never appearing in any comic or movie. Item on the right is the typical Hot Wheels Batmobile (with matte finish) packed in with an off Mr. Freeze car.',0,NULL,0,0,NULL,'2010-02-28 12:37:43','2011-11-10 07:24:11'),(10,NULL,1,'Batman Black &amp; White comic trades','batman-black-amp-white-comic-trades','Both collections of Batman : Black & White stories published by DC Comics.',0,NULL,0,0,NULL,'2010-02-26 02:25:41','2011-11-10 07:24:11'),(11,NULL,1,'Batman : Black &amp; White statue by Mike Mignola','batman-black-amp-white-statue-by-mike-mignola','A beautiful resin statue of Batman based on the artwork of Mike Mignola (of Hellboy fame). One in a series of many.',1,NULL,0,0,NULL,'2010-03-01 01:06:32','2011-11-10 07:24:11'),(12,NULL,1,'Batman original painting by David Mack','batman-original-painting-by-david-mack','Absolutely beautiful original ink painting by acclaimed illustrator David Mack (Kabuki).',0,NULL,0,0,NULL,'2010-02-27 15:39:51','2011-11-10 07:24:11'),(13,NULL,1,'A collection of superhero records, incuding Batman','a-collection-of-superhero-records-incuding-batman','A handful of superhero records, including both music and narratives about Batman and various Justice League members.',0,NULL,0,0,NULL,'2010-02-26 02:26:12','2011-11-10 07:24:11'),(14,NULL,1,'The Batman Theme record by The Marketts','the-batman-theme-record-by-the-marketts','Very interesting 33 RPM record featuring surf-rock interpretations of various Batman TV show themes.',0,NULL,0,0,NULL,'2010-02-17 18:57:56','2011-11-10 07:24:11'),(15,NULL,1,'Pepsi Superhero Series glasses, incl. Batman','pepsi-superhero-series-glasses-incl-batman','A series of DC superhero glasses produced by Pepsi in the 70s and 80s, covering a wide array of heroes and villains.',0,NULL,0,0,NULL,'2010-02-27 14:33:20','2011-11-10 07:24:12'),(16,NULL,1,'Batman &amp; Robin Pepsi glasses','batman-amp-robin-pepsi-glasses','Some more Batman and Robin Pepsi glasses, featuring alternate \'MOON\' decos from an earlier series.',0,NULL,0,0,NULL,'2010-02-21 00:00:55','2011-11-10 07:24:12'),(17,NULL,1,'Batman buttons','batman-buttons','A collection of buttons, including Batman. Many have unfortunately fallen off and vanished over the years, but Batman dominates the satchel!',1,NULL,0,0,NULL,'2010-02-05 00:59:23','2011-11-10 07:24:12'),(18,NULL,1,'Batman original drawing','batman-original-drawing','An original Batman pencil drawing by Ron Adrian (Flash, Supergirl, Birds of Prey).',0,NULL,0,0,NULL,'2010-02-20 16:59:26','2011-11-10 07:24:12'),(19,NULL,1,'Batman vs. Catwoman Lego set','batman-vs-catwoman-lego-set','Batman vs. Catwoman Lego set, one of the smaller offerings from Lego\'s 2006 Batman license.',0,NULL,0,0,NULL,'2010-02-28 23:32:39','2011-11-10 07:24:12'),(20,NULL,1,'Batman : The Animated Series DVDs','batman-the-animated-series-dvds','Seasons 1-4 of Batman : The Animated series on DVD, from Warner Brothers. Possibly one of the finest animated shows ever created, incredibly influential on everything that followed it, due to Bruce Timm\'s powerful but simple character designs.',0,NULL,0,0,NULL,'2010-02-24 16:24:17','2011-11-10 07:24:12'),(21,NULL,1,'Justice League Animated Series DVD feat. Batman','justice-league-animated-series-dvd-feat-batman','An incomplete assortment of Justice League and Justice League Unlimited DVDs, all wonderful and exciting - a great watch!',0,NULL,0,0,NULL,'2010-02-24 16:24:32','2011-11-10 07:24:12'),(22,NULL,1,'Batman video games for Next Gen. consoles','batman-video-games-for-next-gen-consoles','Three Batman (and Justice League) video games for Gamecube and Playstation, even though it\'s argued that there has never been a GOOD Batman video game ever made.',0,NULL,0,0,NULL,'2010-02-24 16:24:53','2011-11-10 07:24:12'),(23,NULL,1,'Batman : Black &amp; White statue by Matt Wagner','batman-black-amp-white-statue-by-matt-wagner','Another in DC Direct\'s series of Batman : Black and White statues, this time based on the art of Matt Wagner.',0,NULL,0,0,NULL,'2010-02-24 16:24:46','2011-11-10 07:24:12'),(24,NULL,1,'Batman Dazed t-shirt','batman-dazed-t-shirt','An original one-off creation by a friend. A satirical take on Batman, and one of my favorite shirts!',0,NULL,0,0,NULL,'2010-02-05 23:37:37','2011-11-10 07:24:12'),(25,NULL,1,'Octopussy','octopussy','A strange little German toy that I found at a tag sale, called \'OCTOPUSSY\'. Has little friction-driven wheels that continue to push it along with a small push from one\'s hand.',1,NULL,0,0,NULL,'2010-02-13 08:24:49','2011-11-10 07:24:12'),(26,NULL,1,'Blooper Magnet from Super Mario Brothers','blooper-magnet-from-super-mario-brothers','A Japanese magnet set that included many 8-bit renditions of Super Mario Brothers 1 characters included this Blooper - squid or jellyfish, you decide!',0,NULL,0,0,NULL,'2010-02-28 18:12:33','2011-11-10 07:24:12'),(27,NULL,1,'Gama-GO Postcard w/ squid','gama-go-postcard-w-squid','A postcard from Gama-Go featuring a squid battling a submarine!',0,NULL,0,0,NULL,'2010-02-24 00:10:44','2011-11-10 07:24:12'),(28,NULL,1,'Kamen Rider IKAFIRE 8\" figure','kamen-rider-ikafire-8-figure','A truly bizarre villain from Kamen Rider called IKAFIRE (\'ika\' is Japanese for \'squid\'). I love kaiju, and I love squid, and this is probably my favorite piece in the squid collection. See other images for box art! It says DEATHTRON! That sounds serious.',0,NULL,0,0,NULL,'2010-02-22 22:02:36','2011-11-10 07:24:12'),(29,NULL,1,'Kamen Rider IKAFIRE 8\" figure box art','kamen-rider-ikafire-8-figure-box-art','The accompanying box art for the aforementioned IKAFIRE figure.',0,NULL,0,0,NULL,'2010-02-22 07:55:35','2011-11-10 07:24:12'),(30,NULL,1,'Ikea Plush Octopus','ikea-plush-octopus','Okay, so it has only 5 legs, but a friend got this from Ikea for me! A lovely plush octo. Or, as the case may be, quinto.',1,NULL,0,0,NULL,'2010-03-01 01:18:37','2011-11-10 07:24:12'),(31,NULL,1,'Octopus Man mini-figure from Japan','octopus-man-mini-figure-from-japan','I\'m not entirely sure WHAT this is, but I think it\'s a mini-figure from Takara in Japan.',0,NULL,0,0,NULL,'2010-02-23 08:29:06','2011-11-10 07:24:12'),(32,NULL,1,'Realistic octopus toy!','realistic-octopus-toy','This is one of those generic-realistic animal toys, but lovely nonetheless.',0,NULL,0,0,NULL,'2010-02-28 23:15:16','2011-11-10 07:24:12'),(33,NULL,1,'Hand-made Snow Squid plush','hand-made-snow-squid-plush','With some leftover scraps of shirts and x-mas decorations, I lovingly hand-sewed this 5-legged plush squid in an afternoon.',0,NULL,0,0,NULL,'2010-02-21 15:52:36','2011-11-10 07:24:12'),(34,NULL,1,'Squid magnet','squid-magnet','Another instance of a friend bringing me back a squid item from a gift shop they encountered while in Florida on vacation.',0,NULL,0,0,NULL,'2010-02-23 09:47:06','2011-11-10 07:24:12'),(35,NULL,1,'O is for Octopus Mug','o-is-for-octopus-mug','Probably the most horribly ugly mug I\'ve EVER seen, but it has an octopus wearing a beret, so it\'s inherently amazing. This cost me one dollar.',0,NULL,0,0,NULL,'2010-03-01 00:04:04','2011-11-10 07:24:12'),(36,NULL,1,'Can of Squid','can-of-squid','This is the can that started it all - I keep it nearby for creepy inspiration. I\'ve even written a song about it and written letters to the company. They\'re either my mascots or my pets - I haven\'t decided which.',0,NULL,0,0,NULL,'2010-02-23 08:51:40','2011-11-10 07:24:12'),(37,NULL,1,'Batman Begins Ornaments','batman-begins-ornaments','Set of 5 Batman Begins Christmas ornaments!',0,NULL,0,0,NULL,'2010-02-22 06:50:20','2011-11-10 07:24:12'),(38,NULL,1,'Ultraman Gashapon 1','ultraman-gashapon-1','A city battle scene between Ultraman and some monstery guy!',1,NULL,0,0,NULL,'2010-02-26 17:35:52','2011-11-10 07:24:12'),(39,NULL,1,'Ultraman Gashapon 2','ultraman-gashapon-2','A dark-hued Ultraman mini figure! About 3\" tall, as is the rest of the collection.',0,NULL,0,0,NULL,'2010-02-24 06:50:23','2011-11-10 07:24:12'),(40,NULL,1,'Ultraman Gashapon 3','ultraman-gashapon-3','I don\'t know what Ultraman scene that this is depicting is, but it\'s pretty hilarious out of context.',1,NULL,0,0,NULL,'2010-02-15 22:20:54','2011-11-10 07:24:12'),(41,NULL,1,'Ultraman Gashapon 4','ultraman-gashapon-4','Ultraman, poised for battle!',0,NULL,0,0,NULL,'2010-02-23 14:44:14','2011-11-10 07:24:12'),(42,NULL,1,'Ultraman Gashapon 5','ultraman-gashapon-5','This guy has another shoe and a telescope thing somewhere. I have no idea who he is, but he\'s clearly some kind of horribly perverse voyeur.',0,NULL,0,0,NULL,'2010-02-23 12:31:15','2011-11-10 07:24:12'),(43,NULL,1,'Masked Rider DEATHTRON #23 : Ikafire','masked-rider-deathtron-23-ikafire','From Medicom Toys, Real Action Heroes figure #23 from Masked Rider, 1/8th scale. This guy\'s name is Ikafire, which is Japanese for.... Squidfire.',0,NULL,0,0,NULL,'2010-02-23 00:31:11','2011-11-10 07:24:12'),(44,NULL,1,'Masked Rider DEATHTRON #23 : Ikafire Box Art','masked-rider-deathtron-23-ikafire-box-art','These Kamen Rider figures come packaged in velcro-sealed window boxes, but the outside art is really great also!',0,NULL,0,0,NULL,'2010-02-23 20:16:28','2011-11-10 07:24:12'),(45,NULL,1,'Masked Rider SHOCKER #13 : Sasori Otoko Box Art','masked-rider-shocker-13-sasori-otoko-box-art','The box art reads \"Shocker is the organization that spred of world allv with the clique and very fierce and horrible. Their evil purpose what to change the humanbeing and subordinate mankind to them and conquer the world.\"',0,NULL,0,0,NULL,'2010-02-15 12:29:32','2011-11-10 07:24:12'),(46,NULL,1,'Masked Rider SHOCKER #13 : Sasori Otoko','masked-rider-shocker-13-sasori-otoko','... at least I THINK it\'s Sasori Otoko .',0,NULL,0,0,NULL,'2010-02-13 05:45:52','2011-11-10 07:24:12'),(47,NULL,1,'Masked Rider SHOCKER #30 : Sabotenguron Box Art','masked-rider-shocker-30-sabotenguron-box-art','A Kamen Rider CACTUS monster!',0,NULL,0,0,NULL,'2010-02-25 18:10:30','2011-11-10 07:24:12'),(48,NULL,1,'Masked Rider SHOCKER #30 : Sabotenguron','masked-rider-shocker-30-sabotenguron','Truly, one must fear the cactus monster.',1,NULL,0,0,NULL,'2010-02-24 12:02:28','2011-11-10 07:24:12'),(49,NULL,1,'Masked Rider DEATHTRON #22 : TV Fly Box Art','masked-rider-deathtron-22-tv-fly-box-art','From Kamen Rider V3, episodes 3 & 4. A TV headed fly. Indeed. \'Deathtron\' is also referred to as \'Destron\' or \'Desutron\'.',0,NULL,0,0,NULL,'2010-02-27 19:59:30','2011-11-10 07:24:12'),(50,NULL,1,'Masked Rider DEATHTRON #22 : TV Fly','masked-rider-deathtron-22-tv-fly','The \'Deathtron\' series also features tarot card artwork inside the packages. TV Fly is represented as \'The World\' in the Major Arcana.',0,NULL,0,0,NULL,'2010-02-26 11:41:37','2011-11-10 07:24:12'),(51,NULL,1,'Masked Rider SHOCKER #15 : Sarasenian Box Art','masked-rider-shocker-15-sarasenian-box-art','An enemy in the first Masked Rider movie, I presume this is a plant-based enemy.',0,NULL,0,0,NULL,'2010-02-18 15:50:30','2011-11-10 07:24:12'),(52,NULL,1,'Masked Rider SHOCKER #15 : Sarasenian','masked-rider-shocker-15-sarasenian','Packaged for easy removal & replacement.',1,NULL,0,0,NULL,'2010-02-28 12:44:50','2011-11-10 07:24:12'),(53,NULL,1,'Masked Rider SHOCKER #29 : Tokageron Box Art','masked-rider-shocker-29-tokageron-box-art','\'Tokage\' means \'lizard\' in Japanese.',0,NULL,0,0,NULL,'2010-02-19 19:02:05','2011-11-10 07:24:12'),(54,NULL,1,'Masked Rider SHOCKER #29 : Tokageron','masked-rider-shocker-29-tokageron','One of the taller Kamen figures, since the whole head / neck section comes separately in the box.',0,NULL,0,0,NULL,'2010-02-17 09:06:01','2011-11-10 07:24:12'),(55,NULL,1,'Masked Rider SHOCKER #14 : Kamakiri Otoko Box Art','masked-rider-shocker-14-kamakiri-otoko-box-art','A Kamen monster based on the praying mantis.',0,NULL,0,0,NULL,'2010-02-13 05:46:42','2011-11-10 07:24:12'),(56,NULL,1,'Masked Rider SHOCKER #14 : Kamakiri Otoko','masked-rider-shocker-14-kamakiri-otoko','Figure comes with a great scythe-on-a-chain accessory.',0,NULL,0,0,NULL,'2010-02-27 23:07:37','2011-11-10 07:24:12'),(57,NULL,1,'Go Hero postcard','go-hero-postcard','Robo-guy vs. an octothing, given out by a neat little designer toy company.',0,NULL,0,0,NULL,'2010-02-20 04:04:30','2011-11-10 07:24:12'),(58,NULL,1,'Sugarplastic 7x7x7 Project : 45 #2','sugarplastic-7x7x7-project-45-2','Part of The Sugarplastic\'s 7x7x7 project - a series of 7 45s released over 7 months (an edition of 300 for each album). THIS one, numbered 241/300, has an image of a squid being eaten by a whale on it!',2,NULL,0,0,NULL,'2010-02-24 02:35:58','2011-11-10 07:24:12'),(59,NULL,1,'Food CD by Iain Ballamy','food-cd-by-iain-ballamy','Allen Spiegel Fine Arts cat. no. ASFA 101, with art by Dave McKean, including a set of art cards. Released on Feral Records, which is partially owned by Dave McKean.',0,NULL,0,0,NULL,'2010-02-26 07:21:35','2011-11-10 07:24:12'),(60,NULL,1,'Food 2 by Iain Ballamy','food-2-by-iain-ballamy','The second in the \'Food\' series by Iain Ballamy, designed by Dave McKean.',0,NULL,0,0,NULL,'2010-02-24 01:12:39','2011-11-10 07:24:12'),(61,NULL,1,'Pepper St. Interludes by Iain Ballamy','pepper-st-interludes-by-iain-ballamy','A beautiful jazz accordion / cello album, made more beautiful by McKean\'s artwork and written intro.',0,NULL,0,0,NULL,'2010-02-27 14:30:12','2011-11-10 07:24:12'),(62,NULL,1,'Signal