e fair are now in Glen Rose Texas.',0,NULL,0,0,NULL,'2010-02-22 23:07:33','2011-11-10 07:24:16'),(303,NULL,2,'Dinosaur Pressed Pennies','dinosaur-pressed-pennies-5c92e1','These are from the Sternberg Museum of Natural History in Hays, KS, The Royal Tyrrell Museum in Drumheller, Alberta, the World\'s Largest Dinosaur in Drumheller, Alberta, and the Mesa Southwest Museum in Mesa, AZ.',0,NULL,0,0,NULL,'2010-02-26 00:33:14','2011-11-10 07:24:16'),(304,NULL,1,'Unicorn with Trumpets','unicorn-with-trumpets','Perhaps the oddest item of all, a unicorn with a bloodied horn, sitting amid a pile of trumpets. Does anyone know the mythology of this?',1,NULL,0,0,NULL,'2010-02-24 19:15:38','2011-11-10 07:24:16'),(305,NULL,1,'Angel','angel','One of a few angel figures from the various series.',0,NULL,0,0,NULL,'2010-02-27 04:02:25','2011-11-10 07:24:16'),(306,NULL,1,'Fire-breathing Wolf','fire-breathing-wolf','Another figure that I don\'t know the mythology of, but it\'s a fire-breathing wolf! Of all of the figures, this one falls apart the most.',1,NULL,0,0,NULL,'2010-03-01 01:18:14','2011-11-10 07:24:16'),(307,NULL,1,'Egyptian Hippo : Taweret','egyptian-hippo-taweret','A representation of the Egyptian god, Set.',2,NULL,0,0,NULL,'2010-02-26 00:52:59','2011-11-10 07:24:16'),(308,NULL,1,'Angel with Trumpet','angel-with-trumpet','Another angel figure from a different series.',0,NULL,0,0,NULL,'2010-02-17 23:41:55','2011-11-10 07:24:16'),(309,NULL,1,'Saintly Woman','saintly-woman','A mysterious woman from series 8.',1,NULL,0,0,NULL,'2010-02-12 01:50:17','2011-11-10 07:24:16'),(310,NULL,1,'Demon riding Snake','demon-riding-snake','A decidedly satanic figure, riding a serpent - complete with forehead pentacle.',0,NULL,0,0,NULL,'2010-03-01 01:19:03','2011-11-10 07:24:16'),(311,NULL,1,'Alligator God : Sobek','alligator-god-sobek','While the Egyptians had many crocodile gods, I think that this is Sobek.',0,NULL,0,0,NULL,'2010-03-01 01:18:39','2011-11-10 07:24:16'),(312,NULL,1,'Saint Nick','saint-nick','A mystery, unlisted figure from series 8 - apparently rare. I believe that this is a representation of Saint Nick.',0,NULL,0,0,NULL,'2010-02-09 21:44:13','2011-11-10 07:24:16'),(313,NULL,1,'Zodiac : Cancer','zodiac-cancer','An expressly creepy figure of Cancer the Crab from the zodiac.',0,NULL,0,0,NULL,'2010-03-01 01:20:11','2011-11-10 07:24:16'),(314,NULL,1,'Zodiac : Aquarius','zodiac-aquarius','One of Japan\'s examples of how comfortable they are with nude figures of all sorts. This is from the Zodiac series, probably Aquarius.',0,NULL,0,0,NULL,'2010-03-01 01:20:41','2011-11-10 07:24:16'),(315,NULL,1,'Skeleton Warrior','skeleton-warrior','Various series had differently weaponed, garbed and colored skeletons. While they were mostly the same with interchangeable parts, it\'s fun to build a skele-army with them.',0,NULL,0,0,NULL,'2010-03-01 01:21:09','2011-11-10 07:24:16'),(316,NULL,1,'Imp','imp','An impish creature on a treasure chest, perhaps a screwy leprechaun.',1,NULL,0,0,NULL,'2010-02-16 16:10:09','2011-11-10 07:24:16'),(317,NULL,1,'Egyptian Vulture : Nekhbet','egyptian-vulture-nekhbet','An animal linked to rulership and protection of the pharaoh.',0,NULL,0,0,NULL,'2010-02-13 00:12:39','2011-11-10 07:24:16'),(318,NULL,1,'Ball of Wings','ball-of-wings','One of the stranger items in the collection, a bodiless ball of wings surrounded by rings.',3,NULL,0,0,NULL,'2010-03-01 01:20:53','2011-11-10 07:24:16'),(319,NULL,1,'Harpy','harpy','A neat little figure of a harpy-type chick.',1,NULL,0,0,NULL,'2010-02-27 06:26:43','2011-11-10 07:24:16'),(320,NULL,1,'Egyptian God','egyptian-god','Not a clue who this guy is, but the alternate-colored version is completely nude and quite proud.',1,NULL,0,0,NULL,'2010-02-28 21:34:50','2011-11-10 07:24:16'),(321,NULL,1,'Zodiac : Gemini','zodiac-gemini','Really creepy Gemini twins figure!',0,NULL,0,0,NULL,'2010-02-21 03:52:59','2011-11-10 07:24:16'),(322,NULL,1,'Zodiac : Leo','zodiac-leo','A Leo figure from the Zodiac series.',1,NULL,0,0,NULL,'2010-02-24 09:09:54','2011-11-10 07:24:16'),(323,NULL,1,'Peacock Horse','peacock-horse','Another creature that I\'m not sure of the mythology of, some horrible combination of mule and peacock.',1,NULL,0,0,NULL,'2010-02-20 21:56:02','2011-11-10 07:24:16'),(324,NULL,1,'Nymph','nymph','A beautiful little nymph creature.',0,NULL,0,0,NULL,'2010-03-01 01:21:19','2011-11-10 07:24:16'),(325,NULL,1,'Green Dragon','green-dragon','A neat little green dragon, without any arms. Dragons pepper the various series and look neat together.',0,NULL,0,0,NULL,'2010-02-15 13:31:25','2011-11-10 07:24:16'),(326,NULL,1,'Six-Winged Man','six-winged-man','Yet another exceptionally surreal creature, a man with six wings and no ordinary limbs. Is this a notable creature in any mythology?',2,NULL,0,0,NULL,'2010-01-23 19:56:09','2011-11-10 07:24:16'),(327,NULL,1,'Egyptian God','egyptian-god-2da7a4','I\'m not even sure what kind pof animal this is, but perhaps it\'s a stylized Jackal, making this either Anubis, Duamutef, Wepwawet, or Sed. Often seved as guides to the dead. Any insights?',1,NULL,0,0,NULL,'2010-02-20 17:20:55','2011-11-10 07:24:16'),(328,NULL,1,'Egyptian Goddess : Isis','egyptian-goddess-isis','...at least, I THINK it\'s Isis. Those folks had a lot of deities.',0,NULL,0,0,NULL,'2010-02-21 19:46:45','2011-11-10 07:24:16'),(329,NULL,1,'Egyptian Deity','egyptian-deity','Uncertain what this guy is! Any ideas?',0,NULL,0,0,NULL,'2010-03-01 01:22:37','2011-11-10 07:24:16'),(330,NULL,1,'Zodiac : Saggitarius','zodiac-saggitarius','A representation of Saggitarius from the Zodiac.',0,NULL,0,0,NULL,'2010-03-01 01:22:27','2011-11-10 07:24:16'),(331,NULL,1,'Zodiac :  Aries','zodiac-aries','Aries, or perhaps Capricorn! An unpainted variant figure - a painted version also exists.',0,NULL,0,0,NULL,'2010-03-01 01:22:43','2011-11-10 07:24:17'),(332,NULL,1,'Water Nymph','water-nymph','A water nymph creature from series 7 - excellent paint work showing the transparent, filmy fabrics