et a picture of this - a Transformers movie ad that spanned over a dozen stories, near the Big Apple Comic Con.',0,NULL,0,0,NULL,'2010-02-08 18:29:30','2011-11-10 07:24:17'),(343,NULL,1,'Wall of action figures','wall-of-action-figures','A collection of overpriced action figures - mostly Marvel Legends - took over a section of the convention. Figures are ALWAYS a pain and a half to carry around at a convention.',0,NULL,0,0,NULL,'2010-02-14 16:46:21','2011-11-10 07:24:17'),(344,NULL,1,'Original Comic Artwork','original-comic-artwork','A booth with a handful of original drawings and paintings that were used for trading cards and comic book covers. Most were well over a thousand dollars each.',0,NULL,0,0,NULL,'2010-01-24 08:41:34','2011-11-10 07:24:17'),(345,NULL,1,'David Faustino','david-faustino','5\' 3\" of pure ex-stardom, but still suitable for Big Apple Comic Con.',0,NULL,0,0,NULL,'2010-02-27 07:02:31','2011-11-10 07:24:17'),(346,NULL,1,'Mego Dolls','mego-dolls','A collection of Mego dolls in average condition, safely protected in a case.',0,NULL,0,0,NULL,'2010-02-23 03:43:28','2011-11-10 07:24:17'),(347,NULL,1,'Another wall of action figures','another-wall-of-action-figures','Some more common, yet costly, action figures that your average Toys R Us could give you at a normal price.',0,NULL,0,0,NULL,'2010-02-24 08:37:55','2011-11-10 07:24:17'),(348,NULL,1,'Costumed guy!','costumed-guy','The only other costumed guy that we saw at BACC that wasn\'t a Jedi. That place was lousy with bargain basement Jedi.',0,NULL,0,0,NULL,'2010-02-22 20:49:23','2011-11-10 07:24:17'),(349,NULL,1,'Vintage Star Wars figures','vintage-star-wars-figures','A wall of vintage Star Wars & GI Joe action figures, including the rare \'telescoping lightsaber luke\'.',0,NULL,0,0,NULL,'2010-02-23 18:02:31','2011-11-10 07:24:17'),(350,NULL,1,'Table of Swords','table-of-swords','Every nerd has sword fantasies, and this table fulfills them. Excessivle ornamental and usually nonfunctional, they still look nice hanging up. In your basement. Where you live. On top of your Dungeons and Dragons books.',1,NULL,0,0,NULL,'2010-02-27 06:26:03','2011-11-10 07:24:17'),(351,NULL,1,'Vintage Superhero Goods','vintage-superhero-goods','I love the superhero stuff from before I was born - and this case was chock full of it. It\'s usually not even THAT expensive!',0,NULL,0,0,NULL,'2010-02-08 09:27:07','2011-11-10 07:24:17'),(352,NULL,1,'Golden Age Comics &amp; Art','golden-age-comics-amp-art','A rack of Golden Age comics, safely away from the grubby hands of the con-goers, and some original comic book art (which always looks amazing in person).',0,NULL,0,0,NULL,'2010-02-24 01:32:30','2011-11-10 07:24:17'),(353,NULL,1,'Guitar Hero','guitar-hero','Guitar Hero has become a stable of any nerd-con. While it doesn\'t match NYCC\'s huge setup to play, this was fair enough.',0,NULL,0,0,NULL,'2010-02-23 01:03:35','2011-11-10 07:24:17'),(354,NULL,1,'Hotel Pennsylvania Outside','hotel-pennsylvania-outside','The line outside the Hotel Pennsylvania was almost nonexistent. We went and bought breakfast and came back.',0,NULL,0,0,NULL,'2010-01-20 16:39:55','2011-11-10 07:24:17'),(355,NULL,1,'Bootleg DVD table','bootleg-dvd-table','Half of these DVDs are probably illegal copies of things, and poor quality.',0,NULL,0,0,NULL,'2010-02-07 06:59:43','2011-11-10 07:24:17'),(356,NULL,1,'Girlie art!','girlie-art','Also at every convention is a wall of girlie art, USUALLY in the vicinity of the aging porn models (who have modeled for half of the images anyhow).',0,NULL,0,0,NULL,'2010-02-08 05:37:51','2011-11-10 07:24:17'),(357,NULL,3,'Yellow Momma Sheep With Baby Lamb','yellow-momma-sheep-with-baby-lamb','\"Momma\" has a bow-tie? Oh well, baby lambie doesn\'t care. One of those vintage ceramic sets where they are to be chained together, but only a chain remains on the baby (so there could be more pieces to this set.',0,NULL,0,0,NULL,'2010-02-24 07:53:22','2011-11-10 07:24:17'),(358,NULL,3,'Kitschy Ceramic Deer','kitschy-ceramic-deer','Also with a bow-tie (also red with white polka dots) and has a loop for a chain, so I\'m hoping to find more to go with this guy at thrift shops.',0,NULL,0,0,NULL,'2010-02-28 07:03:28','2011-11-10 07:24:17'),(359,NULL,3,'Another Yellow Lamb Figurine','another-yellow-lamb-figurine','Looks like the others but this one has a softer color and softer texture than the other set. And the feet are painted gold.',0,NULL,0,0,NULL,'2010-02-28 19:52:56','2011-11-10 07:24:17'),(360,NULL,3,'Large Poodle Figurine','large-poodle-figurine','Lots of white rabbit fur, big blue glass eyes. This was the first piece in this collection and remains the premier piece. (And why not?)',0,NULL,0,0,NULL,'2010-02-28 05:21:48','2011-11-10 07:24:17'),(361,NULL,3,'Retro White Cat Figurine','retro-white-cat-figurine','This was the second piece in this collection. This kitty has some fur issues, and is missing one of her aqua-blue rhinestone eyes. But I love her.',0,NULL,0,0,NULL,'2010-02-23 00:26:47','2011-11-10 07:24:17'),(362,NULL,3,'Three Royal Blue Dogs (Mom &amp; Pups)','three-royal-blue-dogs-mom-amp-pups','Momma\'s the only one with the white rabbit fur appliques, but doesn\'t it just pop?! All three pieces have metal loops for chains to run through, but no chain was found with them.',0,NULL,0,0,NULL,'2010-02-26 23:44:10','2011-11-10 07:24:17'),(363,NULL,3,'Vintage Donkey','vintage-donkey','this donkey has just a tuft of rabbit fur atop his head, crowning his sad but sweet face.',0,NULL,0,0,NULL,'2010-02-28 16:55:31','2011-11-10 07:24:17'),(364,NULL,3,'Vintage Classy Cat','vintage-classy-cat','I call her Frenchie because she\'s quite glamorous. Lots of hand painting along with a bit of rabbit fur applique for her tail. Ooh la la!',0,NULL,0,0,NULL,'2010-02-25 12:27:43','2011-11-10 07:24:17'),(365,NULL,3,'Vintage Dog Nodder Head','vintage-dog-nodder-head','An older nodder, of some generic type of dog.',0,NULL,0,0,NULL,'2010-02-27 19:23:20','2011-11-10 07:24:17'),(36