l so bad when I copied the idea later on -- 12 years later, I still haven\'t gone about it).',0,NULL,0,0,NULL,'2010-02-17 00:54:25','2011-11-10 07:24:17'),(385,NULL,3,'Chief Joseph','chief-joseph','I did the sketch in high school art class (the old \'use a grid to enlarge) based on a photo of Chief Joseph (I will fight no more forever) in a National Geographic Magazine. More than a decade later I matted & finished it. Pencil sketch on heavy board and a rusty-brown matting, with chicken wire and then surrounded by a huge (the piece is over 39 inches tall) grapevine wreath with dream catcher \'stitches\' with pheasant feathers woven in. (There were more feathers, but cats have, over time, carried a few of the feathers off.) Don\'t sweat it if you don\'t get this piece; most people don\'t.',0,NULL,0,0,NULL,'2010-02-24 13:44:48','2011-11-10 07:24:17'),(386,NULL,3,'African (Or African American) Woman Pastels','african-or-african-american-woman-pastels','The very first joint purchase hubby and I ever made was when we bought a huge old portfolio of an art student\'s sketches. This was one of the magnificent pieces found inside. We put her in one of the large antique wooden frames I (naturally) just had laying around. (She is stunning but very difficult to photograph -- the old glass has many imperfections so there\'s no way for me to avoid reflections. Poo.)',0,NULL,0,0,NULL,'2010-02-23 09:06:18','2011-11-10 07:24:17'),(387,NULL,3,'Jesus On Velvet','jesus-on-velvet','Can\'t call yourself a lover of kitsch and not own stunning paint on velvet!',0,NULL,0,0,NULL,'2010-02-23 10:41:12','2011-11-10 07:24:17'),(388,NULL,3,'Deer Art Study','deer-art-study','The very first joint purchase hubby and I ever made was when we bought a huge old portfolio of an art student\'s sketches. This is one of the animal studies (several in a series).',0,NULL,0,0,NULL,'2010-02-20 02:16:56','2011-11-10 07:24:17'),(389,NULL,3,'Mares Running Their Colts, by C.W. Anderson','mares-running-their-colts-by-cw-anderson','Still in the original frame and matt. Signed/numbered (but it\'s too high on the wall for me to reach -- remind me, and I\'ll get the ladder out). I\'ve had this since I was a kid (likely a spendy $1 at the time) and I\'ve noticed the prints they sell now have the horses running the other way',0,NULL,0,0,NULL,'2010-02-23 21:38:06','2011-11-10 07:24:17'),(390,NULL,3,'Vintage Blonde Pastel (Framed)','vintage-blonde-pastel-framed','The very first joint purchase hubby and I ever made was when we bought a huge old portfolio of an art student\'s sketches. This was another one of the magnificent pieces found inside -- very pinup-esque. We put her in one of the large antique wooden frames I (naturally) just had laying around.',0,NULL,0,0,NULL,'2010-02-23 23:33:11','2011-11-10 07:24:17'),(391,NULL,3,'Horse Sketch','horse-sketch','A sketch I did. (This is just the sketch; it is matted and framed and can partially be seen with Chief Joseph.)',0,NULL,0,0,NULL,'2010-02-21 08:21:00','2011-11-10 07:24:17'),(392,NULL,3,'Nikko, Wolf Sketch','nikko-wolf-sketch','This is a sketch of Nikko, a wolf at a preserve in Greendale, Wisconsin. As an artist, I was given special access to view and photograph the wolves. Nikko and a 2 others did \'meet\' me snout to hand through a fence -- others warned me to guard my camera lens (so their rough tongues don\'t destroy it), but I was too busy peeing my pants with delight to care and told them all so. Nikko is also the wolf featured on special Wisconsin license plates (to benefit the Endangered Resources Fund at the Wisconsin Department of Natural Resources). A bit of Nikko can be spotted, framed, in the Chief Joseph photo.',2,NULL,0,0,NULL,'2010-02-26 08:17:59','2011-11-10 07:24:17'),(393,NULL,2,'Sinclair Lead Dino Figure','sinclair-lead-dino-figure','This lead figure is from the 1930s.',2,NULL,0,0,NULL,'2010-02-28 11:03:45','2011-11-10 07:24:17'),(394,NULL,2,'T-Rex Cafe Shirt','t-rex-cafe-shirt','From the T-Rex Cafe in Kansas City,