7:24:44'),(766,NULL,2,'American Museum of Natural History Post Card','american-museum-of-natural-history-post-card','This is a giant post card that shows a scene from a painting at the American Museum of Natural History in NY. The painting features Allosaurus and Camptosaurus. I am not sure if this painting is still on display at the museum. I don\'t know the artist either - I\'m pretty sure its not Charles Knight. I got the post card at an estate sale in Lawrence, KS on 9-15-07 for 25 cents.',1,NULL,0,0,NULL,'2010-02-20 20:06:09','2011-11-10 07:24:44'),(767,NULL,2,'Dinosaur National Monument Post Card','dinosaur-national-monument-post-card','This post card shows the visitor\'s center at Dinosaur National Monument. The building is built over a large outcrop full of dinosaur bones. I have wanted to go here ever since I first saw it on Reading Rainbow. Unfortunately, this building is now closed down because it is structually unsound. I got this post card at an estate sale in Lawrence, KS on 9-15-07 for 25 cents.',3,NULL,0,0,NULL,'2010-02-18 16:58:26','2011-11-10 07:24:44'),(768,NULL,2,'Pressed Pennies, Coins and JP Dogtags','pressed-pennies-coins-and-jp-dogtags','This is a box of more dinosaur pressed pennies and other collectibles. Pressed pennies are from such places as the Academy of Natural Sciences in Philadelphia, Pennsylvania, Knoebel\'s Amusement Park, Elysburg, Pennsylvania, and Universal Studios, Hollywood, California.',0,NULL,0,0,NULL,'2010-02-27 18:57:12','2011-11-10 07:24:44'),(769,NULL,2,'Dink the Little Dinosaur Premiums','dink-the-little-dinosaur-premiums','I think these are from Burger King',0,NULL,0,0,NULL,'2010-02-06 08:50:24','2011-11-10 07:24:44'),(770,NULL,2,'Parasaurolophus Post Card','parasaurolophus-post-card','This post card was actually an invitation to my best friend\'s birthday party some time back in the 80s. I think the artist is Matthew Kalmenoff.',0,NULL,0,0,NULL,'2010-02-25 17:26:33','2011-11-10 07:24:44'),(771,NULL,3,'Purple Elephant with Red Bowtie','purple-elephant-with-red-bowtie','Another ceramic piece, with a chain to attach it to the (missing) babies. A gift from my mommie. :)',0,NULL,0,0,NULL,'2010-02-27 21:42:10','2011-11-10 07:24:44'),(772,NULL,2,'Boxed Set of British Museum Dinosaurs','boxed-set-of-british-museum-dinosaurs','This is a boxed set of the Invicta British Museum dinosaurs. I bought this for $4 at an estate sale in Lawrence, KS.',1,NULL,0,0,NULL,'2010-02-27 22:36:03','2011-11-10 07:24:44'),(773,NULL,3,'Merry Widow Waltz','merry-widow-waltz','Merry Widow Waltz, with Ukelele Chords, Guitar Chords, and Special Hawaiian Guitar Chorus, lyrics by Carl Field, music by Franz Lehar, 1935, Calumet Music Co. The previous owner of The Merry Widow Waltz felt that Jesse Crawford, \"Poet of the Organ\", needed a beard and mustache. Who am I to argue? See more scans here: http://www.kitschy-kitschy-coo.com/index.php?content=450',0,NULL,0,0,NULL,'2010-02-28 22:05:14','2011-11-10 07:24:44'),(774,NULL,3,'Igloo, Oggle Woggle Goo','igloo-oggle-woggle-goo','copyright 1939, Harry Tenney Inc, New York. Features a photo of Shep Fields along with a cute graphic of a silhouetted couple inside an igloo. Words by Irving Taylor, music by Vic Mizzy. For more on this rare gem in sheet music, including lyrics, see here: http://www.kitschy-kitschy-coo.com/index.php?content=449',0,NULL,0,0,NULL,'2010-02-28 22:05:23','2011-11-10 07:24:44'),(775,NULL,3,'Jolly Darkies Carnival Sketches','jolly-darkies-carnival-sketches','\"Jolly Darkies\" by Karl Bechter. This sheet music art features two seated men in blackface, dressed in finery, tamborine at their feet. One has his voice raised in song as he plays the banjo, the other has his head lowered and he keeps the rhythm on spoons. A unique piece of Black Americana. Measures 12.25 x 9 inches, covers & one \'insert\' page. Carnival Sketches series 5003, Theodore Pressor Co. © 1925 Wilhelmina Goerdeler.',0,NULL,0,0,NULL,'2010-02-15 15:21:54','2011-11-10 07:24:44'),(776,NULL,3,'Samson Agonistes Score','samson-agonistes-score','A mysterious copy of Robert Starer\'s work \"Samson Agonistes,\" written as a ballet for choreographer Martha Graham and first performed in 1960. While the actual music on each page appears hand-written, this seems to be a photocopy reproduction of the original. The book is marked in several places, \"Return All Material To Leeds Music Corp, 322 West 48th St N.Y.C.\", but this one apparently did not make it home.',0,NULL,0,0,NULL,'2010-02-28 06:20:02','2011-11-10 07:24:44'),(777,NULL,3,'Tip Toe Through The Tulips With Me','tip-toe-through-the-tulips-with-me','Classic roaring 20\'s flapper era sheet music. Tip Toe Through The Tulips With Me, lyrics by Al Dubin, music by Joe Burke, and published by M. Witmark & Sons, copyright 1929. From The Gold Diggers of Broadway, a Warner Bros Vitaphone Talking Picture (Warner Bros & Vitaphone Singing Pictures / First National & Vitaphone Singing Pictures), this sheet music features Winnie Lightner, Ann Pennington, Nick Lucas, Lilyan Tashman, Conway Tearle, and Nancy Welford.',0,NULL,0,0,NULL,'2010-02-25 11:26:48','2011-11-10 07:24:44'),(778,NULL,3,'Music, Maestro, Please','music-maestro-please','Music, Maestro, Please, As Presented in The Orchid Room of Hollywood Hotel, by Raymond Paige, Frances Langford, Frank Parker, Anne Jamison and Louella Parsons. (Yes, that Louella Parsons!) Words by Herb Magidson, music by Allie Wrubel. Copyright 1938, Irving Berlin Inc.',0,NULL,0,0,NULL,'2010-02-16 18:08:49','2011-11-10 07:24:44'),(779,NULL,2,'The Dinosaurs Invade Life Magazine Article','the-dinosaurs-invade-life-magazine-article','This is an article from a 1963 Life magazine about the dinosaur sculptures for the 1964-65 NY World\'s Fair. The sculptures were brought by barge up the Hudson River. This article is overshadowed by the JFK funeral cover story in the same issue.',0,NULL,0,0,NULL,'2010-02-28 10:39:04','2011-11-10 07:24:44'),(780,NULL,2,'Dinamation Poster','dinamation-poster','This is a neat item. It is a poster for Dinamation, a company that made life size animated models of dinosaurs that toured the county. The poster is on 3 transparancies, each one a solid color. When overlaid, all the colors combine to make a color picture.',0,NULL,0,0,NULL,'2010-02-27 23:31:30','2011-11-10 07:24:44'),(781,NULL,2,'Jurassic Park Collector\'s Edition Standee','jurassic-park-collectors-edition-standee','This cardboard standee is an advertisement for The Collector\'s Edition of Jurassic Park and The Lost World.',0,NULL,0,0,NULL,'2010-02-20 23:16:25','2011-11-10 07:24:44'),(782,NULL,2,'Jurassic Park Standee','jurassic-park-standee','This Jurassic Park Standee is from the release of the original Jurassic Park on video. It has a couple pieces that need to be glued back in place.',0,NULL,0,0,NULL,'2010-03-01 01:16:45','2011-11-10 07:24:44'),(783,NULL,2,'Jurassic Park Press Kit','jurassic-park-press-kit','This press kit is for the release of Jurassic Park on video.',0,NULL,0,0,NULL,'2010-02-14 06:38:03','2011-11-10 07:24:44'),(784,NULL,2,'Jurassic Park III Standee','jurassic-park-iii-standee','This standee advertises the release of Jurassic Park III on VHS and DVD. I was able to get it from the local video store.',0,NULL,0,0,NULL,'2010-02-17 11:02:05','2011-11-10 07:24:44'),(785,NULL,2,'PaleoWorld Mobile','paleoworld-mobile','This is a mobile advertising PaleoWorld, a TV show about paleontology that was on The Learning Channel.',1,NULL,0,0,NULL,'2010-02-22 22:56:36','2011-11-10 07:24:44'),(786,NULL,2,'Dinamation Poster','dinamation-poster-c3b09e','This is draft Dinamation poster from an exhibit in Pennsylvania.',0,NULL,0,0,NULL,'2010-02-19 00:19:42','2011-11-10 07:24:44'),(787,NULL,2,'Recast Marx Revised Mold Group','recast-marx-revised-mold-group','Ok, I got these at a garage sale in Lawrence, KS. Now these next sentences will make no sense unless you collect Marx dinosaur toys...They are apparently recasts from the Marx revised mold group. There have 