0,NULL,0,0,NULL,'2010-03-01 03:32:37','2011-11-10 07:24:47'),(944,NULL,2,'Apatosaurus illustration','apatosaurus-illustration','This is from a series of prints of illustrations from the book Dinosaurs and More Dinosaurs by M. Jean Craig. The illustrator is George Solonevich - his style is very unique and I think its pretty cool. The prints all say 1965 Scholastic Magazines Inc. These are not pages from the book - I\'m not sure exactly what they are, but I think they might be a set that was available as teaching aids? I could be totally wrong - when I hear Scholastic I think of the book clubs in school. This is cool because it is actually labeled Apatosaurus, not Brontosaurus in 1965!',0,NULL,0,0,NULL,'2010-02-07 13:52:48','2011-11-10 07:24:47'),(945,NULL,2,'Stegosaurus illustration','stegosaurus-illustration','Stegosaurus from the Scholastic set.',0,NULL,0,0,NULL,'2010-02-18 03:35:42','2011-11-10 07:24:47'),(946,NULL,2,'Plateosaurus illustration','plateosaurus-illustration','Plateosaurus from the Scholastic set.',0,NULL,0,0,NULL,'2010-02-09 13:38:41','2011-11-10 07:24:47'),(947,NULL,2,'Anatosaurus illustration','anatosaurus-illustration','Anatosaurus from the Scholastic set.',0,NULL,0,0,NULL,'2010-02-09 12:01:41','2011-11-10 07:24:47'),(948,NULL,2,'Polacanthus illustration','polacanthus-illustration','Polacanthus from the Scholastic set.',0,NULL,0,0,NULL,'2010-02-16 12:11:40','2011-11-10 07:24:47'),(949,NULL,2,'Tyrannosaurus illustration','tyrannosaurus-illustration','Tyrannosaurus from the Scholastic set.',0,NULL,0,0,NULL,'2010-02-25 17:24:19','2011-11-10 07:24:47'),(950,NULL,2,'Ornitholestes illustration','ornitholestes-illustration','Ornitholestes from the Scholastic set.',0,NULL,0,0,NULL,'2010-02-24 22:04:12','2011-11-10 07:24:47'),(951,NULL,2,'Yaleosaurus illustration','yaleosaurus-illustration','Yaleosaurus from the Scholastic set. A.k.a. Anchisaurus. Looks more like a dragon!',0,NULL,0,0,NULL,'2010-02-26 05:41:53','2011-11-10 07:24:47'),(952,NULL,2,'Camptosau