r Christmas Time, 1963','joyous-music-for-christmas-time-1963','4 records, various choruses and orchestras.',0,NULL,0,0,NULL,'2010-02-05 06:12:53','2011-11-10 07:24:53'),(1129,NULL,1,'Christmas in New York (Vol. 2), 1968','christmas-in-new-york-vol-2-1968','Yet another by this title.',0,NULL,0,0,NULL,'2010-02-15 20:13:28','2011-11-10 07:24:53'),(1130,NULL,1,'Home for Christmas, 1964','home-for-christmas-1964','Arr. by Henri Rene.',0,NULL,0,0,NULL,'2010-02-26 01:41:02','2011-11-10 07:24:53'),(1131,NULL,1,'Harlequin Demon','harlequin-demon','Top of head spins around!',0,NULL,0,0,NULL,'2010-02-28 14:57:09','2011-11-10 07:24:53'),(1132,NULL,1,'Behemoth','behemoth','From the 5th wave, these were somehow underproduced and run at a relatively high price - worth it, though, because he\'s one of my favorite characters.',0,NULL,0,0,NULL,'2010-02-27 09:50:20','2011-11-10 07:24:53'),(1133,NULL,1,'Bat Boy &amp; Cyclops Mummy Kid','bat-boy-amp-cyclops-mummy-kid','Included in a 2-pack together, very tiny!',0,NULL,0,0,NULL,'2010-02-28 22:50:34','2011-11-10 07:24:53'),(1134,NULL,1,'Devil','devil','Comes with pitchfork.',0,NULL,0,0,NULL,'2010-02-28 22:50:05','2011-11-10 07:24:53'),(1135,NULL,1,'Christmas Elves','christmas-elves','These are two of the elves that appear in Christmastown. They didn\'t come together, but were packed in with other figures.',0,NULL,0,0,NULL,'2010-02-28 15:39:29','2011-11-10 07:24:53'),(1136,NULL,1,'Doctor Finkelstein','doctor-finkelstein','The creepy creator and owner of Sally, wheelchair bound. His head opens up to reveal a brain, which is split into hemispheres and can be removed for inspirational stroking. Wheelchair has turning wheels & movable joysticks. Comes with plans for skele-reindeer and the skull of his future girlfriend.',0,NULL,0,0,NULL,'2010-02-27 09:49:15','2011-11-10 07:24:53'),(1137,NULL,1,'Sally (Version 2)','sally-version-2','The first release of Sally is exceptionally rare, so I settled for this second one, which is arguably better due to the inclusion of her sewing machine. Possibly one of the best accessories ever.',0,NULL,0,0,NULL,'2010-02-28 01:29:28','2011-11-10 07:24:53'),(1138,NULL,1,'Clown With the Tear-Away Face','clown-with-the-tear-away-face','Disappointingly, this character from wave 5 (voiced by Danny Elfman) does NOT have a removable face. He does have a spinning propeller, and his unicycle is held rigid with a metal dowel instead of the usual plastic.',0,NULL,0,0,NULL,'2010-02-28 01:30:22','2011-11-10 07:24:53'),(1139,NULL,1,'Corpse Mom &amp; Corpse Kid','corpse-mom-amp-corpse-kid','Curiously absent is the Corpse Dad, who appeared with them in every scene. These are from wave 6, and are joined together with a leash.',0,NULL,0,0,NULL,'2010-02-28 01:30:40','2011-11-10 07:24:53'),(1140,NULL,1,'Jack Skellington (Version 1)','jack-skellington-version-1','From wave 1, all of the Jacks are EXTREMELY delicate and break often. This Jack comes with his pet dog, Zero.',0,NULL,0,0,NULL,'2010-03-01 02:29:37','2011-11-10 07:24:53'),(1141,NULL,1,'Undersea Gal','undersea-gal','I adore all mer-things. The Undersea Gal comes with her pool and a table. her torso also detaches so she can rest comfortably inside her pool.',0,NULL,0,0,NULL,'2010-02-27 22:22:01','2011-11-10 07:24:53'),(1142,NULL,1,'Creature Usder the Stairs &amp; Melting Man','creature-usder-the-stairs-amp-melting-man','These two came in a pack together in wave 6 (along with the roadkill turtle).',0,NULL,0,0,NULL,'2010-03-01 00:27:36','2011-11-10 07:24:53'),(1143,NULL,1,'Jack Skellington (Version 2)','jack-skellington-version-2','This Jack (from wave 6) includes all you see here - a work table, a microscope, a chair and a pair of scissors. Otherwise, he\'s identical to the first Jack. Still, it\'s good to have a second one around due to easy breakage issues.',0,NULL,0,0,NULL,'2010-03-01 03:34:59','2011-11-10 07:24:53'),(1144,NULL,1,'Cyclops &amp; Human Kid','cyclops-amp-human-kid','I don\'t think these guys came together. The Cyclops has an openable mouth, and the kid is holding a shrunken head (to the terror of his parents). He\'s the only human in the entire set.',1,NULL,0,0,NULL,'2010-02-27 09:53:42','2011-11-10 07:24:53'),(1145,NULL,1,'Vampire','vampire','There were 5 vampires in the film - I believe that this was the medium-sized one, and I\'m kinda pining for the missing 4. Also included here is a Christmas toy gone wrong.',0,NULL,0,0,NULL,'2010-02-27 09:53:03','2011-11-10 07:24:53'),(1146,NULL,1,'Igor','igor','Dr. Finkelstein\'s lab assistant. I think he makes only one appearance in the film.',0,NULL,0,0,NULL,'2010-03-01 03:32:42','2011-11-10 07:24:53'),(1147,NULL,1,'Santa Jack','santa-jack','Includes a removable hat. Both of his legs have fallen off in this picture.',0,NULL,0,0,NULL,'2010-02-27 09:52:49','2011-11-10 07:24:53'),(1148,NULL,1,'The Witches','the-witches','The two witches featured in the film, both include broomsticks & real hair.',0,NULL,0,0,NULL,'2010-02-27 23:40:36','2011-11-10 07:24:54'),(1149,NULL,1,'The Mayor','the-mayor','Includes a megaphone and some scrolls for future Halloween celebration plans (pictured with other figures). He features two faces - the other one can be spun around and brought to the front.',0,NULL,0,0,NULL,'2010-02-27 09:52:24','2011-11-10 07:24:54'),(1150,NULL,1,'Mr. Hyde','mr-hyde','From wave 6, this guy includes a whole mess of little guys that hide under his hat and perform little tasks everywhere. His hat can be removed and a stack of the guys can be plugged in.',0,NULL,0,0,NULL,'2010-02-28 01:44:32','2011-11-10 07:24:54'),(1151,NULL,1,'Lock, Shock &amp; Barrel','lock-shock-amp-barrel','These guys are the three kidnappers who abduct the Easter Bunny & Santa to Halloween Town, using their mobile bathtub for transportation. They have removable masks, candy and weapons. Interestingly, they\'re voiced by Danny Elfman (who also sang for Jack, and has a similar appearance to the devil character), Catherine O\'Hara (voice of Sally) and Paul Reubens (aka 