p','A serious thought for today, Is one that may cause us dismay, Just what are the forces That bring little horses, If all of the horses say \"nay\"? ESCO 1941',0,NULL,0,0,NULL,'2010-02-19 15:02:13','2011-11-10 07:25:15'),(1555,NULL,3,'Card D Girls - Tree','card-d-girls-tree','I think that I shall never see A girl refuse a meal that\'s free. A girl whose hungry eyes aren\'t fixed Upon a drink that\'s being mixed; A girl who doesn\'t like to wear A lot of junk to match her hair. Girls like these are loved by me, For who in hell would kiss a tree?',0,NULL,0,0,NULL,'2010-02-19 15:03:36','2011-11-10 07:25:15'),(1556,NULL,3,'Card E Ice v Heat','card-e-ice-v-heat','I don\'t want an iceman husband I\'d get chills from his cold feet; What I want is a red hot fireman To exhaust me with the heat.',0,NULL,0,0,NULL,'2010-02-19 15:03:08','2011-11-10 07:25:15'),(1557,NULL,3,'Card F Mama','card-f-mama','Mama waited up for her And met her at the door. Her hair was in an awful mess, Her skirt trailed on the floor. Mama gave her hell that night But daughter wasn\'t sad. For what she did, her Ma had done And that accounts for Dad.',0,NULL,0,0,NULL,'2010-02-18 20:29:26','2011-11-10 07:25:15'),(1558,NULL,3,'Vintage Risque Linen Postcard No 80','vintage-risque-linen-postcard-no-80','The difference between a mouse and a bathing beauty One harms the cheese, the other charms the hes',0,NULL,0,0,NULL,'2010-02-23 23:21:06','2011-11-10 07:25:15'),(1559,NULL,3,'Where Did You Spend Your Last Vacation?','where-did-you-spend-your-last-vacation','Mom says: Time we was gettin\' a son-in-law Pa. Daughter (with baby) says: Paw -- I\'d Druther have that cute Mr (name \"Livley\" written in). \"Livley, of course, refers to the person sent too ;) MWM # HB602',0,NULL,0,0,NULL,'2010-02-26 13:14:09','2011-11-10 07:25:15'),(1560,NULL,3,'Lady Mechanics','lady-mechanics','Sign on wall says: We employ only lady mechanics. Man in red sports car says, to pair of shapely legs sticking out from under the car, \"Yes