,0,0,NULL,'2010-02-27 21:33:36','2011-11-10 07:25:17'),(1572,NULL,1,'Aquaman (Classic) : Wave 2','aquaman-classic-wave-2','Hero-king of Atlantis! Comes with trident. Alternate version has long hair.',0,NULL,0,0,NULL,'2010-03-01 00:11:07','2011-11-10 07:25:17'),(1573,NULL,1,'Firestorm (Classic) : Wave 2','firestorm-classic-wave-2','Firestorm includes 2 nuclear-hand-bolt-things. Alternate version is \'modern\', with a African American face.',1,NULL,0,0,NULL,'2010-02-27 21:33:44','2011-11-10 07:25:17'),(1574,NULL,1,'Superman Blue &amp; Red : Wave 2','superman-blue-amp-red-wave-2','One of Superman\'s many re-births. Both include energy bolts that can be removed from the hands. The back ones are stuck on.',1,NULL,0,0,NULL,'2010-02-27 21:34:19','2011-11-10 07:25:17'),(1575,NULL,1,'Gorilla Grodd : Wave 2 Collect-and-Connect','gorilla-grodd-wave-2-collect-and-connect','A superintelligent gorilla, made from 5 parts contained with the other figures.',0,NULL,0,0,NULL,'2010-03-01 04:48:27','2011-11-10 07:25:17'),(1576,NULL,6,'Tiny Lynn - Littke Lehman\'s Half-Fast Songs','tiny-lynn-littke-lehmans-half-fast-songs','I\'m amazed this one doesn\'t show up on more \"Awful album cover\" blogs. I can\'t even locate any reference to it on the internet! It\'s gotta be pretty rare. Yeah, hard to believe this thing wasn\'t picked up by a major label and then go double-platinum. Guess that makes you one of the lucky few to see it and suffer permanent psychological damage as a result.',0,NULL,0,0,NULL,'2010-02-28 03:41:04','2011-11-10 07:25:17'),(1577,NULL,6,'Joyce (Joyce Drake) - self-titled','joyce-joyce-drake-self-titled','Here it is, folks – the one, the only - MEGA-RARE, LEGENDARY \"JOYCE\" LP!!!! For those of you in-the-know, Joyce, and this album, need no introduction. For the rest of you, welcome to her world... Who is the mysterious Joyce? She\'s Joyce Drake. Why the fuss about the album? In the world of bad record covers and bizarre outsider/real people discs, this has become a cult classic. Widely regarded as \"the world\'s worst album cover\", it\'s not surprising that its the most popular record on the bizarrerecords web site, and is the featured prominently as such in Nick DiFonzo’s book, \"The World\'s Worst Record Covers Ever!\". It consistently shows up on many \"top 100\" lists of strange and worst record covers; and newspaper, magazine and online articles, as well as blog posts, show up all over – many include creative and hilarious descriptions of Joyce – the woman, the music and the album (one of my favorites being the writebrainmanifestations site\'s faux transcript to Joyce\'s \"VH1 Behind The Music Special\" – you\'ll definitely want to check it out). Often compared with Dustin Hoffman\'s character of Dorothy Michaels in the movie, \"Tootsie\", Joyce\'s image can be found online superimposed on all kinds of things (sexy bodies, celebrities, etc.) and is featured on all kinds of merchandise, including (but not limited to) t-shirts, coffee mugs, and even (gulp!!) the \"Joyce Thong\"! And sometimes the tables are turned – others\' faces are superimposed on Joyce\'s body! Ahhh, the sweet smell of creativity... This album has stimulated great interest in Joyce, the person. Who is this \"Lady of Mystery\"? Some speculated she was a guy in drag (see the \"Tootsie\" comment above), others thought she was an incognito celebrity. And up until several months ago, when her whereabouts were finally discovered, there was a \"worldwide search\" to learn who Joyce really was (there was even talk of hiring a private investigator to locate her!). Turns out she\'s a \"real person\"; and sorry, guys, she\'s already taken - she\'s the wife of an Assembly Of God minister in Sealy, Texas. And what about the music? For many, this is inconsequential – but in case you\'re interested, it\'s pleasant contemporary Christian fare. For obvious reasons, the title alone to her tune \"I Get All Excited\" has already made it as a cult classic in outsider music circles. And for similar reasons, \"It\'s My Desire\" should someday run a close second. Anyway, I call this \"THE MONA LISA OF STRANGE RECORD COVERS\", because, like the Mona Lisa, her inscrutable look elicits all kinds of wild speculation as to what she\'s thinking (not to mention what they were thinking when they chose this picture for the cover!). And also like the Mona Lisa, this is EXCEEDINGLY RARE (other than my copy, it appears that less than ten copies are known to exist!)',2,NULL,0,0,NULL,'2010-03-01 03:49:57','2011-11-10 07:25:17'),(1578,NULL,6,'Charlie Barnet - Redskin Romp','charlie-barnet-redskin-romp','Classic and rare jazz LP with Jim Flora cover art!',0,NULL,0,0,NULL,'2010-02-26 08:22:59','2011-11-10 07:25:17'),(1579,NULL,6,'Buzz Adlam - Back To Music','buzz-adlam-back-to-music','I just love the subtlety of this one...',0,NULL,0,0,NULL,'2010-02-26 08:22:21','2011-11-10 07:25:17'),(1580,NULL,6,'Los Melodicos - La Cachimba de San Juan','los-melodicos-la-cachimba-de-san-juan','Put THAT in your pipe and smoke it...',0,NULL,0,0,NULL,'2010-02-26 05:06:26','2011-11-10 07:25:17'),(1581,NULL,6,'Jim Fassett - Strange To Your Ears','jim-fassett-strange-to-your-ears','Strange to your ears...and eyes. One of the all-time greats in bizarre albums.',0,NULL,0,0,NULL,'2010-02-22 23:01:01','2011-11-10 07:25:17'),(1582,NULL,6,'Erotica','erotica','Classic completely deranged LP of moans, groans and sounds of a couple \"getting it on\", atop a very squeaky mattress! With the added bonus of spliced-in congas and yells by an unidentified musician or two. On the Kent label (originally released in the early \'60s on the Fax label as a \"research\" album, but without the great artwork you see here). This album includes the hilarious \"serious\" liner notes from the original.',1,NULL,0,0,NULL,'2010-02-22 23:00:59','2011-11-10 07:25:17'),(1583,NULL,6,'Johnny Houston - Makin\' Bacon','johnny-houston-makin-bacon','Two pigs \"porking\". I really don\'t know what else to say...',2,NULL,0,0,NULL,'2010-02-28 10:36:48','2011-11-10 07:25:17'),(1584,NULL,6,'Tommy Meekins - Turned on To Jesus','tommy-meekins-turned-on-to-jesus','A total head-shaker. The overall gestalt of hideousness immediately caught my attention, but the weirdness of the individual parts make this a classic - the concept, the clothes, the hand, the goofy expression, the album title...everything! A model for how NOT to make an album cover! Find thousands more of the world\'s worst album covers at www.blackgemrecords.com',0,NULL,0,0,NULL,'2010-02-27 05:14:47','2011-11-10 07:25:17'),(1585,NULL,6,'Russ Hodges - The Giants Win The Pennant ','russ-hodges-the-giants-win-the-pennant','\"THE GIANTS (hack, hack) WIN (cough, hack, spit, hack) THE PENNANT...\". Rare 12\" 78 in LP format, limited edition by Chesterfield cigarettess! Classic Russ Hodges play-by-play.',0,NULL,0,0,NULL,'2010-02-26 08:22:37','2011-11-10 07:25:17'),(1586,NULL,6,'Captain Hook &amp; His Pirate Crew - Shiver Me Timbers','captain-hook-amp-his-pirate-crew-shiver-me-timbers','\"In yet another gross miscalculation, The Captain tries to kill Satan, forgetting that he\'s already dead...\". One of the all-time classic crazy Christian kids LPs. Kooky conception by a guy who parlayed tragedy into \"big bucks\", after getting into a car accident as a teenager and losing an arm and a leg. Talk about creativity, huh?',0,NULL,0,0,NULL,'2010-02-22 23:00:52','2011-11-10 07:25:17'),(1587,NULL,6,'Dolores Gray - Warm Brandy','dolores-gray-warm-brandy','Very rare and beautiful original mono turquoise label copy by starlet known as \"the bod\". Yes, she definitely made into show biz on acting talent alone...',0,NULL,0,0,NULL,'2010-02-22 23:00:50','2011-11-10 07:25:17'),(1588,NULL,6,'The Addicts Sing','the-addicts-sing','Crack \"heads???\". Classic rarity of former junkies doing an ad-libbed musical \"drama\" about drug addiction and finding God. Back cover includes illustration of a guy shooting up. Amazing!',0,NULL,0,0,NULL,'2010-02-25 06:29:01','2011-11-10 07:25:17'),(1589,NULL,6,'The Pied Pipers','the-pied-pipers','Extremely rare paranoid propaganda/John Birch Society stuff, and an all-time classic - a demented soundtrack to an \"educational\" documentary for parents of teenagers, describing how rock & roll, the media and the schools are used as a commie plot to glamorize rampant sex and drug use to overthrow freedom. Quotes from Grace Slick and Frank Zappa are offered as proof!! Killer cover art and partial transcript on back. Creepy, delicious and hilarious!',0,NULL,0,0,NULL,'2010-02-28 22:43:58','2011-11-10 07:25:17'),(1590,NULL,6,'Dale Coody - Heaven Came Down','dale-coody-heaven-came-down','Heaven came down - right on my head.',0,NULL,0,0,NULL,'2010-03-01 00:36:58','2011-11-10 07:25:17'),(1591,NULL,6,' Presleys\' Mountain Music Jamboree ','presleys-mountain-music-jamboree','\"Elvis never did speak much about his slow twin brother...\". Private homemade wonder brought to you live from Presley\'s Mountain Music Theatre in Branson, MO.',0,NULL,0,0,NULL,'2010-02-26 08:23:14','2011-11-10 07:25:17'),(1592,NULL,6,'Jimi Hendrix &amp; Jim Morrison - Sky High','jimi-hendrix-amp-jim-morrison-sky-high','Rare original 1972 release on Skydog of 1970 boot jam session w/Jimi Hendrix, Jim Morrison and Johnny Winter!',0,NULL,0,0,NULL,'2010-03-01 04:45:20','2011-11-10 07:25:17'),(1593,NULL,6,'Hansadutta Swami - Nothing To Lose But All To Gain','hansadutta-swami-nothing-to-lose-but-all-to-gain','Impossibly strange private spiritual-psych lunacy by infamous criminal ex-cult leader! Beyond-the-pale music in the \"so-bad-it\'s-freakin\'-hilariously-good\" vein.',0,NULL,0,0,NULL,'2010-03-01 02:10:59','2011-11-10 07:25:18'),(1594,NULL,6,'Bernard Peiffer - Piano A La Mood','bernard-peiffer-piano-a-la-mood','Efforts fail at training Fifi to limbo...',0,NULL,0,0,NULL,'2010-03-01 01:07:41','2011-11-10 07:25:18'),(1595,NULL,6,'Eddie Barclay - Surprise Party','eddie-barclay-surprise-party','Pinocchio at the bondage par