54a Fryin\' Ryan, 54b Charred Chad',0,NULL,0,0,NULL,'2010-03-01 01:58:25','2011-11-10 07:25:38'),(1894,NULL,3,'GPK 72','gpk-72','72a Mad Max, 72b Brainy Brian',0,NULL,0,0,NULL,'2010-02-24 17:44:48','2011-11-10 07:25:38'),(1895,NULL,3,'GPK 113','gpk-113','113a Alice Island, 113b Liberty Libby',0,NULL,0,0,NULL,'2010-02-24 08:38:14','2011-11-10 07:25:38'),(1896,NULL,3,'GPK 70','gpk-70','70a Bad Breath Seth, 70b Foul Phil',0,NULL,0,0,NULL,'2010-02-22 15:47:58','2011-11-10 07:25:38'),(1897,NULL,3,'GPK 115','gpk-115','115a Warmin\' Norman, 115b Well Done Sheldon',0,NULL,0,0,NULL,'2010-02-26 10:49:28','2011-11-10 07:25:38'),(1898,NULL,3,'GPK 159','gpk-159','159a Catty Kathy',0,NULL,0,0,NULL,'2010-02-27 00:25:48','2011-11-10 07:25:38'),(1899,NULL,3,'GPK 90','gpk-90','90a Stoned Sean, 90b Thick Vic',0,NULL,0,0,NULL,'2010-02-27 12:05:38','2011-11-10 07:25:38'),(1900,NULL,3,'GPK 99','gpk-99','99a Beaky Becky, 99b Picky Mickey',0,NULL,0,0,NULL,'2010-02-28 14:29:25','2011-11-10 07:25:38'),(1901,NULL,3,'GPK 141','gpk-141','141a Ashley Can',0,NULL,0,0,NULL,'2010-02-27 13:05:07','2011-11-10 07:25:38'),(1902,NULL,3,'GPK 45','gpk-45','45a Leaky Lindsay, 45b Messy Tessy',0,NULL,0,0,NULL,'2010-02-28 17:22:11','2011-11-10 07:25:38'),(1903,NULL,7,'1955 Porsche \"Continental\" and 1956 Continental Ma','1955-porsche-continental-and-1956-continental-ma','There were 3,013 Mark II coupes made but only 3 legitimate convertibles fabricated for Ford. This is the first of three made. It was done by Hess & Eisenhardt in Cincinnati in 1955, just before the new cars were introduced. The Porsche 356 \"Continental\" cabrio is one of about 100 made and less than 10 remain.',0,NULL,0,0,NULL,'2010-01-22 15:03:36','2011-11-10 07:25:40'),(1904,NULL,7,'The Phoenix','the-phoenix','This is a 1951 Royal Spartanette travel trailer that I converted into a car hauler for our show cars. The garage area is 21 feet long and has an air-conditioned Tiki lounge up front. See my build site at http://cardomain.com/ride/340096/5',0,NULL,0,0,NULL,'2010-02-18 12:29:47','2011-11-10 07:25:40'),(1905,NULL,7,'Lincoln Continental limousine','lincoln-continental-limousine','This car was made from two 1968 Lincoln Continentals spliced together. This is my current project. here\'s the build site. http://www.cardomain.com/ride/752157',0,NULL,0,0,NULL,'2010-02-18 12:29:57','2011-11-10 07:25:40'),(1906,NULL,7,'1956 Continental Mark II convertible','1956-continental-mark-ii-convertible','This is the crown jewel of our collection. There were 3,000 Continental Mark IIs made in 1956 and 1957 but there were only three convertibles made from new cars. This was the first one made. Here\'s my site: http://cardomain.com/ride/340096',0,NULL,0,0,NULL,'2010-02-18 12:35:52','2011-11-10 07:25:40'),(1907,NULL,7,'1956 Chris Craft 18\' Continental','1956-chris-craft-18-continental','The \"Continental\" was a line of Chris-Craft luxury utility boats. I know that\'s an oxymoron but that\'s what it is. This is an unsanded original boat that is in near-showroom condition.',0,NULL,0,0,NULL,'2010-02-06 22:38:58','2011-11-10 07:25:40'),(1908,NULL,7,'\"Blinky\"','blinky','Blinky is a nearly new 1977 Lincoln Town Car. I bought it 25 years old with under 13,000 miles on it. The back seat had never been sat in. The name came about from calling it Big Lincoln, then \"Blincoln\" and the \"Blinky\". We\'re also huge Simpsons fans hence the three-eyed-fish \"Blinky\" on the dashboard.',0,NULL,0,0,NULL,'2010-02-11 10:43:54','2011-11-10 07:25:40'),(1909,NULL,7,'1955 Porsche 356 Continental Cabrio','1955-porsche-356-continental-cabrio','This is a very rare early Porsche convertible. Fewer than 10 remain of the 200 that were built. It is the only year that a Porsche Cabrio carried the name \"Continental\" as the US importer convinced Porsche that Americans only bought cars with names, not numbers. Ford took exception to the use of the \"Continental\" name and made them stop using it. In 1956 the car was called the 356-A. Ford won.',0,NULL,0,0,NULL,'2010-01-26 05:14:23','2011-11-10 07:25:40'),(1910,NULL,7,'Untitled Item','untitled-item','',0,NULL,0,0,NULL,'2010-02-14 12:21:10','2011-11-10 07:25:40'),(1911,NULL,7,'Giraffes, porcelain on copper','giraffes-porcelain-on-copper','This is an early \'50s piece by an artist that goes by the initials \"JD\". I\'ve seen other works by this artist but I know nothing about him/her.',0,NULL,0,0,NULL,'2010-02-28 03:15:18','2011-11-10 07:25:40'),(1912,NULL,7,'Stainless arrows','stainless-arrows','This weathervane was made by a senior class of a trade school as a fundraiser. This was the last one made as the director retired and the program ended.',0,NULL,0,0,NULL,'2010-02-15 23:30:18','2011-11-10 07:25:40'),(1913,NULL,7,'Frustration','frustration','When I built my home I was cutting a beam for an expansion of the garage. I marked one end of the beam and it appeared that the line was not perpendicular to the edge. You check a square by putting on the other edge and striking a line. They crossed in the center, which told me the square was no longer square, which made it useless. In frustration I twisted it into a pretzel and slammed it down on the kitchen counter. It has remained there for 13 years as a testimonial to building one\'s own home.',0,NULL,0,0,NULL,'2010-02-27 04:47:49','2011-11-10 07:25:40'),(1914,NULL,7,'Silver lady','silver-lady','This sculpture by Raymond Parmenter is solid silver. It was commissioned by the infamous Hunt brother who tried to corner the silver market. They made a lot of people a lot of money and had 50 of these made as gifts for their largest investors. The woman I acquired it from left it covered for 20 years so her grandson wouldn\'t see the nudity. I\'ve let it patina to a natural shade.',0,NULL,0,0,NULL,'2010-02-17 07:40:20','2011-11-10 07:25:40'),(1915,NULL,7,'Tulip vase','tulip-vase','This bronze vase has the image of a wispy, beautiful woman and an image of a dragon fly. Some have dated it to the \'teens.',0,NULL,0,0,NULL,'2010-02-15 10:18:40','2011-11-10 07:25:40'),(1916,NULL,7,'Weather vane','weather-vane','This is a large outdoor piece that adorns the center of our back yard. It is raw steel, copper and aluminum.',0,NULL,0,0,NULL,'2010-02-07 08:34:50','2011-11-10 07:25:40'),(1917,NULL,7,'Giraffes and other critters','giraffes-and-other-critters','We have over 50 giraffes from 3\" to 6\'6\" tall. These are but a few. We appreciate the gracefulness of such an awkward being.',0,NULL,0,0,NULL,'2010-02-28 20:58:15','2011-11-10 07:25:40'),(1918,NULL,7,'Pellet lady','pellet-lady','This artist makes forms of his subjects out of plaster. He lines the inside of the mold with metal pellets used in stamping parts. They are all the same weight but not all the same size and shape. they are all welded together from the backside of the sculpture.',0,NULL,0,0,NULL,'2010-02-20 12:31:41','2011-11-10 07:25:40'),(1919,NULL,7,'Bronze giraffe','bronze-giraffe','Nicely done Asian bronze import. Probably a bunch of them out there but it is a nice quality.',0,NULL,0,0,NULL,'2010-02-28 04:37:13','2011-11-10 07:25:40'),(1920,NULL,7,'Bronze dolphins','bronze-dolphins','I love dolphins. This was just a fanciful purchase.',0,NULL,0,0,NULL,'2010-02-20 21:03:45','2011-11-10 07:25:41'),(1921,NULL,7,'Symbiosis','symbiosis','This is my wife\'s favorite piece and her first major purpose. After standing in front of it for a couple of minutes she said, \"I get it!\". It\'s the symbiotic relationship between the book and the mind.',0,NULL,0,0,NULL,'2010-02-19 22:24:04','2011-11-10 07:25:41'),(1922,NULL,7,'Dancers','dancers','This artist forms the bodies of dancers out of wax. He the ties and winds colored wire around the wax bodies. The wax is melted away leaving the ethereal image of a dancer.',0,NULL,0,0,NULL,'2010-02-24 13:47:52','2011-11-10 07:25:41'),(1923,NULL,7,'Metal mobile','metal-mobile','Positioned over the range top the rising heat makes these move in a very soothing manner.',0,NULL,0,0,NULL,'2010-02-14 18:32:41','2011-11-10 07:25:41'),(1924,NULL,7,'Reflection','reflection','This was created in the \'70 out of cast bronze. The circle looks clear but is simply a bronze mirror that reverses the lettering in the front row to alighn with the lettering in the back row. This works from any angle.',0,NULL,0,0,NULL,'2010-02-21 04:38:56','2011-11-10 07:25:41'),(1925,NULL,7,'Aluminum Indian head','aluminum-indian-head','This came off of a 1915 Herschell-Spillman Ccarousel',0,NULL,0,0,NULL,'2010-02-19 06:49:30','2011-11-10 07:25:41'),(1926,NULL,7,'Develope\'','develope','This is another sculpture by Raymond Parmenter. Develope\' is a term that applies to the dance move depicted',0,NULL,0,0,NULL,'2010-02-25 20:05:00','2011-11-10 07:25:41'),(1927,NULL,7,'Bronze nude','bronze-nude','This was actually part of a failed casting of an full body nude. It looks like an ancient relic.',0,NULL,0,0,NULL,'2010-02-21 12:11:25','2011-11-10 07:25:41'),(1928,NULL,7,'Spoon giraffe','spoon-giraffe','This is by artist Boban. He works in stainless steel silverware. Onida is his sponsor.',0,NULL,0,0,NULL,'2010-02-24 21:19:08','2011-11-10 07:25:41'),(1929,NULL,7,'Silver dolphin','silver-dolphin','This sculpture is cast in silver with a bronze base.',1,NULL,0,0,NULL,'2010-02-17 16:51:35','2011-11-10 07:25:41'),(1930,NULL,7,'Bronze flower','bronze-flower','This is actually a door knocker that was prettier as an art piece.',0,NULL,0,0,NULL,'2010-02-14 20:15:39','2011-11-10 07:25:41'),(1931,NULL,7,'Classic cars','classic-cars','This is our 1956 Continental Mark II convertible (one of three) and our 1955 Porsche \"Continental\" cabrio (about 10 left in the world).',1,NULL,0,0,NULL,'2010-02-09 09:09:52','2011-11-10 07:25:41'),(1932,NULL,7,'Steel doe','steel-doe','Made of rusted car parts she only shows up in the winter and hides in the foliage during the summer.',0,NULL,0,0,NULL,'2010-02-19 22:40:41','2011-11-10 07:25:41'),(1933,NULL,7,'Perpetual motion','perpetual-motion','Made of polished stainless steel the top two segments rotate independent of each other, creating the illusion that the metal is fluid.',0,NULL,0,0,NULL,'2010-02-12 15:15:12','2011-11-10 07:25:41'),(1934,NULL,7,'Mounted cyclist','mounted-cyclist','This androgynous figure by Lewis Tardy is made of bicycle, transmission and other junkyard parts. The helmet is a hood ornament from a \'53 Chevy.',0,NULL,0,0,NULL,'2009-12-24 12:25:23','2011-11-10 07:25:41'),(1935,NULL,7,'Stainless rings','stainless-rings','This is about as close to perpetual motion as you can get. Each stainless ring was cut from the center of the larger ring. An axle is attached at the balance point of each ring and each axle rides on its own track. Once the rings are set in motion they will rock back and forth for about 45 minutes with no assistance. Very soothing.',0,NULL,0,0,NULL,'2010-02-25 20:43:11','2011-11-10 07:25:41'),(1936,NULL,7,'Reflection','reflection-a5ce8f','Another view',0,NULL,0,0,NULL,'2010-02-24 23:49:48','2011-11-10 07:25:41'),(1937,NULL,7,'Bronze dancer','bronze-dancer','This is one of our early pieces. Look below at Gumby. That\'s how seriously we take ourselves.',0,NULL,0,0,NULL,'2010-02-19 05:02:12','2011-11-10 07:25:41'),(1938,NULL,7,'Fireplace grate','fireplace-grate','This is actually a push bar from a 1920s bronze entry door to a Philadelphia post office',0,NULL,0,0,NULL,'2010-02-11 12:15:21','2011-11-10 07:25:41'),(1939,NULL,7,'Stainless rings','stainless-rings-530a2e','Another view',0,NULL,0,0,NULL,'2009-12-23 09:38:38','2011-11-10 07:25:41'),(1940,NULL,7,'Duplicate','duplicate','Duplicate',0,NULL,0,0,NULL,'2010-02-09 09:38:36','2011-11-10 07:25:41'),(1941,NULL,7,'Steel pellet lady','steel-pellet-lady','another view',0,NULL,0,0,NULL,'2010-01-06 03:14:22','2011-11-10 07:25:41'),(1942,NULL,7,'Towel rack','towel-rack','When towel is in place it covers her \"privates\".',0,NULL,0,0,NULL,'2010-02-26 08:41:19','2011-11-10 07:25:41'),(1943,NULL,7,'Structural post','structural-post','When I built the house I needed a structural member to support the floor above. I made the post to follow the pattern of our Frank Lloyd inspired window pattern.',0,NULL,0,0,NULL,'2010-02-27 11:23:38','2011-11-10 07:25:41'),(1944,NULL,7,'Steel giraffe','steel-giraffe','Another piece mad as a gift from the artist Lewis Tardy.',0,NULL,0,0,NULL,'2010-01-30 15:55:04','2011-11-10 07:25:41'),(1945,NULL,7,'1951 Royal Spartanette Toybox','1951-royal-spartanette-toybox','I spent 3 years converting a 1951 travel trailer into a toy hauler and lounge for transporting our show cars.',2,NULL,0,0,NULL,'2010-02-28 20:03:30','2011-11-10 07:25:41'),(1946,NULL,7,'Icarus rising','icarus-rising','greek figure Icarus is often depicted failing and falling to Earth after his wings of wax melted. This is another piece by Boban. It\'s made of stainless steel spoons. It stands 5 feet tall with a wingspan of 4 feet.',0,NULL,0,0,NULL,'2010-02-28 11:25:08','2011-11-10 07:25:41'),(1947,NULL,7,'Bronze horse','bronze-horse','By Canadian artist Barrie Faulkner. he also created our other piece, \"Symbiosis\"',0,NULL,0,0,NULL,'2010-02-09 20:46:45','2011-11-10 07:25:41'),(1948,NULL,7,'Walker','walker','By Lewis Tardy. Made of found metal pieces.',0,NULL,0,0,NULL,'2010-02-27 05:42:08','2011-11-10 07:25:41'),(1949,NULL,7,'Nymph','nymph-bd7ca1','Made from a steel hoop from an old wagon wheel and scrap metal.',0,NULL,0,0,NULL,'2010-02-08 12:05:39','2011-11-10 07:25:41'),(1950,NULL,7,'Steel giraffe','steel-giraffe-282c08','Made from found parts. 6-feet tall',0,NULL,0,0,NULL,'2010-02-15 00:06:10','2011-11-10 07:25:41'),(1951,NULL,7,'Ecorche','ecorche','An ecorche is a study in the skeleton and musculature of an animal. One side depicts the skeleton and the other the muscles.',1,NULL,0,0,NULL,'2010-02-07 07:27:28','2011-11-10 07:25:41'),(1952,NULL,7,'Pegasus','pegasus','Steel outdoor sculpture',0,NULL,0,0,NULL,'2010-02-10 03:27:03','2011-11-10 07:25:41'),(1953,NULL,7,'Climbers','climbers','It appears that these bronze guys are climbing into a waiting space ship.',0,NULL,0,0,NULL,'2010-02-22 01:43:52','2011-11-10 07:25:41'),(1954,NULL,7,'Tree of Life','tree-of-life','This is a silver-plated menorah surrounded by silver critters',0,NULL,0,0,NULL,'2009-12-29 01:20:42','2011-11-10 07:25:41'),(1955,NULL,7,'Towel rack w/towel','towel-rack-w-towel','Covered \"privates\"',0,NULL,0,0,NULL,'2010-01-21 13:12:48','2011-11-10 07:25:41'),(1956,NULL,7,'Bronze giraffe','bronze-giraffe-b44fb7','The mate to the giraffe by the piano',0,NULL,0,0,NULL,'2010-02-13 22:22:34','2011-11-10 07:25:41'),(1957,NULL,7,'Harley','harley','This is a body cast of a model name Harley. It\'s done in pewter.',0,NULL,0,0,NULL,'2010-02-20 04:20:27','2011-11-10 07:25:41'),(1958,NULL,7,'Silver dolphin','silver-dolphin-0c98ef','Another view',0,NULL,0,0,NULL,'2010-02-26 18:23:02','2011-11-10 07:25:41'),(1959,NULL,7,'Stainless gecko ','stainless-gecko','Just a fun piece',0,NULL,0,0,NULL,'2010-02-11 09:53:54','2011-11-10 07:25:41'),(1960,NULL,7,'Ecorche','ecorche-7a0599','Another view',0,NULL,0,0,NULL,'2010-02-09 10:14:49','2011-11-10 07:25:41'),(1961,NULL,7,'Bronze Deco door grille','bronze-deco-door-grille','This is a decorative door grill from a 1920s post office. It\'s incredible as it\'s a one-piece flawless casting that is three feet wide and six feet tall.',0,NULL,0,0,NULL,'2010-02-11 13:24:40','2011-11-10 07:25:41'),(1962,NULL,7,'Bronze gecko and stash box','bronze-gecko-and-stash-box','More bronze critters.',0,NULL,0,0,NULL,'2010-01-20 00:35:31','2011-11-10 07:25:41'),(1963,NULL,7,'Bronze doorbell button','bronze-doorbell-button','Whimsical doorbell button. Our dog kept attacking it when we first put it up.',0,NULL,0,0,NULL,'2010-02-25 08:38:13','2011-11-10 07:25:41'),(1964,NULL,7,'Pegasus','pegasus-c6ffb6','This is a large bronze sculpture, weighing in at 150 lbs. The amazing part is that the entire weight of the sculpture is on the ankle of the rear leg. A titanium rod was cast into the sculpture for strength.',0,NULL,0,0,NULL,'2010-02-09 00:33:35','2011-11-12 10:41:44'),(1965,NULL,7,'Nickelodeon panels and Coca-Cola lamp','nickelodeon-panels-and-coca-cola-lamp','Most people have never actually seen a Nickelodeon. I was a coin-operated piano that provided entertainment. You could see the music scroll by as the piano played. The Coca-Cola lamp is an early reproduction.',0,NULL,0,0,NULL,'2010-02-21 01:12:37','2011-11-10 07:25:41'),(1966,NULL,7,'Another gecko','another-gecko','They\'re everywhere.',0,NULL,0,0,NULL,'2010-02-16 09:17:24','2011-11-10 07:25:41'),(1967,NULL,7,'Bronze frog','bronze-frog','By Tim Cotterill. he has a huge following amongst frog collectors.',0,NULL,0,0,NULL,'2010-02-10 03:52:17','2011-11-10 07:25:41'),(1968,NULL,7,'Tree of Life','tree-of-life-54bde1','If you look closely you will see that the branches are people.',0,NULL,0,0,NULL,'2010-02-10 10:59:02','2011-11-10 07:25:41'),(1969,NULL,7,'Mounted Cyclist','mounted-cyclist-121f81','Another view of Lewis Tardy\'s signature sculpture.',0,NULL,0,0,NULL,'2010-02-27 11:40:18','2011-11-10 07:25:41'),(1970,NULL,7,'Japanese picture frame','japanese-picture-frame','Since the traditional Japanese house has paper walls, where do you hang art? This is a free-standing picture frame that would sit on the floor instead of hanging on a wall. We commissioned a Canadian artist to do the sand-blasted underwater scene for us.',0,NULL,0,0,NULL,'2010-02-06 01:45:45','2011-11-10 07:25:41'),(1971,NULL,7,'Frank Lloyd Wright railing rip-off','frank-lloyd-wright-railing-rip-off','Being fans of FLLW we commissioned a furniture artist, Michael Walchen, to build the railing for our staircase. It\'s made of curly maple and black walnut and cost more than our first home. It\'s the last time I had unfettered access to our checkbook. :(',5,NULL,0,0,NULL,'2010-02-28 21:43:17','2011-11-10 07:25:41'),(1972,NULL,7,'Miniature chairs','miniature-chairs','These are from a series of famous designer chairs offered by a German Museum',0,NULL,0,0,NULL,'2010-02-28 17:17:44','2011-11-10 07:25:41'),(1973,NULL,7,'Pistachio Seed','pistachio-seed','This is an incredible carving by French artist Alain Mailland. Google his name. Alain specializes in wood turnings that are so delicate that it\'s amazing the any piece is finished without breaking. We saw one of his works at the Detroit Institute of Arts and contacted him. This is his latest work.',0,NULL,0,0,NULL,'2010-03-01 01:58:31','2011-11-10 07:25:41'),(1974,NULL,7,'Wood vase','wood-vase','An art fair acquisition. Interesting use of rare woods.',0,NULL,0,0,NULL,'2010-02-21 00:48:33','2011-11-10 07:25:41'),(1975,NULL,7,'Bird bowl','bird-bowl','While the bowl is nicely done the carved wood bird is so realistic that we had to protect it from our cats initially',0,NULL,0,0,NULL,'2010-02-27 23:30:35','2011-11-10 07:25:41'),(1976,NULL,7,'Pedestal','pedestal','We commissioned the artist that did our star railing to make us three pedestal in three heights.',0,NULL,0,0,NULL,'2010-02-22 05:10:15','2011-11-10 07:25:41'),(1977,NULL,7,'Wood inlay mirror','wood-inlay-mirror','Birds-eye maple and ebony.',0,NULL,0,0,NULL,'2010-02-24 09:50:04','2011-11-10 07:25:41'),(1978,NULL,7,'Turned vase','turned-vase','Vase turned out of curly maple and ebony',0,NULL,0,0,NULL,'2010-02-23 22:09:52','2011-11-10 07:25:41'),(1979,NULL,7,'Marquetry','marquetry','marquetry is the art of using wood veneers to depict scenes. This was done by Jeff Nelson. he also did the music board on our piano.',0,NULL,0,0,NULL,'2010-02-27 11:25:43','2011-11-10 07:25:41'),(1980,NULL,7,'Wood pedestal','wood-pedestal','We needed a large pedestal to display the large bronze Pegasus so we had one made to fit our decor.',0,NULL,0,0,NULL,'2010-02-21 07:50:55','2011-11-10 07:25:42'),(1981,NULL,7,'Wood carving','wood-carving','This piece is incredibly 3-dimentional. When you look at it from the side it become almost 2-dimentional. It\'s from a South American artist.',0,NULL,0,0,NULL,'2010-02-26 07:54:22','2011-11-10 07:25:42'),(1982,NULL,7,'Puzzle box','puzzle-box','My wife bought this as a gift while on a trip to Florida. When she went through security she couldn\'t remember how to open it so it had to be x-rayed.',0,NULL,0,0,NULL,'2010-02-23 00:16:44','2011-11-10 07:25:42'),(1983,NULL,7,'1970 Howard Miller prototype credenza','1970-howard-miller-prototype-credenza','This prototype credenza fit our needs as a component rack for our plasma TV. It\'s ebony and Mahogany',0,NULL,0,0,NULL,'2010-02-27 07:12:34','2011-11-10 07:25:42'),(1984,NULL,7,'Wood carving side view','wood-carving-side-view','You can see how everything flattens out.',0,NULL,0,0,NULL,'2010-02-27 23:30:35','2011-11-10 07:25:42'),(1985,NULL,7,'Alessi clock','alessi-clock','Ebony and birds-eye maple.',0,NULL,0,0,NULL,'2010-02-15 06:36:46','2011-11-10 07:25:42'),(1986,NULL,7,'\"Happy\", the carousel giraffe','happy-the-carousel-giraffe','Happy is a 1915 Hershell-Spillman carousel animal that was restored by a Franklin Mint detail painter. Happy is 6\'6\" tall and still has the hole for the carousel pole.',0,NULL,0,0,NULL,'2010-02-26 10:57:55','2011-11-10 07:25:42'),(1987,NULL,7,'Wood box','wood-box','decorative wood box made from an exotic African wood.',0,NULL,0,0,NULL,'2010-02-09 16:51:27','2011-11-10 07:25:42'),(1988,NULL,7,'\"Under the sea\"','under-the-sea','Another marquetry piece by Jeff Nelson. It\'s one of his limited edition \"Windows on the World\".',0,NULL,0,0,NULL,'2010-02-06 10:22:58','2011-11-10 07:25:42'),(1989,NULL,7,'Howard Miller grandfather clock','howard-miller-grandfather-clock','Almost incongruous to the rest of our collection, this classic grandfather clock is one of the \"Presidential Series clocks by Howard Miller.',0,NULL,0,0,NULL,'2010-01-31 11:16:11','2011-11-10 07:25:42'),(1990,NULL,7,'Wood screen','wood-screen','Made from rare wood burls and veneers, this screen shimmers in the right light.',0,NULL,0,0,NULL,'2010-01-18 04:51:39','2011-11-10 07:25:42'),(1991,NULL,7,'Folk art','folk-art','This is probably the only piece of American Folk Art in our collection. It reminds us of the many cats we\'ve had. It\'s a painted barrel stake.',0,NULL,0,0,NULL,'2010-02-15 01:53:59','2011-11-10 07:25:42'),(1992,NULL,7,'\"Mobius\"','mobius','A Mobius can be formed by taking a narrow sheet of paper, twisting the ends three times and reconnecting the ends. It\'s a mathematical term that describes the shape. This was hand carved out of a solid block of \"spalted\" maple. The black lines you see are bacterial that have worked their wy into a maple log that had fallen on the forest floor and began to decompose. The artist soaks the wood in a bath of chemicals that kills the bacteria and stabilizes the wood. The wood is carved to be 1/8\" thick over the whole piece. Amazing craftsmanship.',0,NULL,0,0,NULL,'2010-02-08 21:31:01','2011-11-10 07:25:42'),(1993,NULL,7,'Music board','music-board','The music board on our Steinway \"B\" was created for Steinway by Jeff Nelson. He made 52 of them. %0 were sent to master distributors in each state, he kept one and gave one to us.',0,NULL,0,0,NULL,'2010-02-12 00:50:33','2011-11-10 07:25:42'),(1994,NULL,7,'Wood pedestal','wood-pedestal-2cd260','The third of the three pedestals we had made.',0,NULL,0,0,NULL,'2010-02-16 19:32:31','2011-11-10 07:25:42'),(1995,NULL,7,'Hope chest','hope-chest','We had an artist make is a hope chest lined with aromatic cedar as a liner, cherry structure and Bubinga veneer panels.',0,NULL,0,0,NULL,'2010-02-08 14:58:27','2011-11-10 07:25:42'),(1996,NULL,3,'Sailor Iris','sailor-iris','Sailor Iris',0,NULL,0,0,NULL,'2010-02-22 16:16:14','2011-11-10 07:25:42'),(1997,NULL,3,'Poseidon\'s Adventure','poseidons-adventure','Altered art; Poseidon has his own surprise.',0,NULL,0,0,NULL,'2010-02-26 10:24:24','2011-11-10 07:25:42'),(1998,NULL,3,'Save That Pig!','save-that-pig','Altered art piece in which a man (now) saves a pig from a flood.',0,NULL,0,0,NULL,'2010-02-10 22:38:41','2011-11-10 07:25:42'),(1999,NULL,2,'Pez-A-Saurs set','pez-a-saurs-