','2011-11-10 07:25:48'),(2108,NULL,1,'\'All Star\' Wonder Woman','all-star-wonder-woman','From Re-Activated.',0,NULL,0,0,NULL,'2010-02-27 07:07:41','2011-11-10 07:25:48'),(2109,NULL,1,'\'Kingdom Come\' Wonder Woman','kingdom-come-wonder-woman','Based on the art of Alex Ross. The figure was later re-released with better quality control.',0,NULL,0,0,NULL,'2010-02-25 01:10:49','2011-11-10 07:25:48'),(2110,NULL,1,'\'New Frontier\' Wonder Woman','new-frontier-wonder-woman','Based on the art of Darwyn Cooke.',0,NULL,0,0,NULL,'2010-01-31 22:27:29','2011-11-10 07:25:48'),(2111,NULL,1,'\'Amazonia\' Wonder Woman','amazonia-wonder-woman','==',1,NULL,0,0,NULL,'2010-02-01 17:49:01','2011-11-10 07:25:48'),(2112,NULL,1,'\'JLU\' Wonder Woman','jlu-wonder-woman','Small-scale WW from the animated series.',0,NULL,0,0,NULL,'2010-02-18 18:54:44','2011-11-10 07:25:48'),(2113,NULL,1,'\'Trinity\' Wonder Woman','trinity-wonder-woman','Based on the art of Matt Wagner.',0,NULL,0,0,NULL,'2010-02-12 03:03:48','2011-11-10 07:25:48'),(2114,NULL,1,'\'JLA Classified\' Wonder Woman','jla-classified-wonder-woman','Based on the art of Ed McGuinness.',1,NULL,0,0,NULL,'2010-02-27 07:06:41','2011-11-10 07:25:48'),(2115,NULL,1,'\'JLA\' Wonder Woman','jla-wonder-woman','From the first JLA series by DC Direct.',0,NULL,0,0,NULL,'2010-02-10 23:41:30','2011-11-10 07:25:48'),(2116,NULL,1,'\'Pocket Heroes\' Wonder Woman','pocket-heroes-wonder-woman','--',0,NULL,0,0,NULL,'2010-02-22 03:26:19','2011-11-10 07:25:48'),(2117,NULL,1,'\'Justice\' Wonder Woman','justice-wonder-woman','Based on the art of Alex Ross.',0,NULL,0,0,NULL,'2010-02-27 07:07:08','2011-11-10 07:25:48'),(2118,NULL,1,'Minimate Wonder Woman','minimate-wonder-woman','==',0,NULL,0,0,NULL,'2010-02-11 20:47:10','2011-11-10 07:25:48'),(2119,NULL,1,'Minimate \'Red Son\' Wonder Woman','minimate-red-son-wonder-woman','==',0,NULL,0,0,NULL,'2010-02-28 04:56:56','2011-11-10 07:25:48'),(2120,NULL,1,'Minimate Battle Damaged Wonder Woman','minimate-battle-damaged-wonder-woman','--',0,NULL,0,0,NULL,'2010-02-08 12:07:56','2011-11-10 07:25:48'),(2121,NULL,7,'Egyptian cancellation plate','egyptian-cancellation-plate','A cancellation plate is an artist\'s final use of a plate, capping off the series. The corner of the plate is clipped, destroying the plate but creating a unique work of art. The pieces you see in this collection are all one-of-a-kind works of art. The artists are Jan and Mel Fleck.',0,NULL,0,0,NULL,'2010-02-23 05:09:52','2011-11-10 07:25:48'),(2122,NULL,7,'Mr. Head','mr-head','This is a very large ceramic sculpture from Rochester, MI. All of his sculptures are self-portraits with odd scenes painted on them. The painting on this piece is of the Ford Rouge Steel mill before it exploded. The eyes follow you. Freaked out our dog.',0,NULL,0,0,NULL,'2010-02-12 04:29:51','2011-11-10 07:25:48'),(2123,NULL,7,'Afternoon nap.','afternoon-nap','I really don\'t know how to describe this. It\'s very surreal and photorealistic. The artist is Karen Halt. She was a psychiatriatic nurse. That may explain a few things.',0,NULL,0,0,NULL,'2010-02-20 23:42:03','2011-11-10 07:25:48'),(2124,NULL,7,'Hung up on strange fruit','hung-up-on-strange-fruit','Jonathan Winters is a well known comedian. He\'s also a very strange artist. While this is one of the few copies in our collection. It intrigued me due to the fact that it\'s a 32-color silkscreen. The odds of pulling 32 screens successfully are very low. We actually bought this as part of a package to get one of his original works, \"A New Member\".',0,NULL,0,0,NULL,'2010-02-22 21:20:14','2011-11-10 07:25:48'),(2125,NULL,7,'Thunder sky','thunder-sky','This fools all but the very keen-eyed. It\'s a pencil drawing, not a photograph. Horses are one of my favorite collectables. I don\'t think there\'s a more majestic creature.',1,NULL,0,0,NULL,'2010-02-23 18:18:22','2011-11-10 07:25:48'),(2126,NULL,7,'Shaded doorway','shaded-doorway','The famous automotive artist Tom Hale is a friend. We toured his home/studio and this piece caught my eye. It has depth and texture that\'s hard to get out of a painting. This is off of his normal subject manner, whic appealed to me.',0,NULL,0,0,NULL,'2010-02-27 11:24:24','2011-11-10 07:25:48'),(2127,NULL,2,'Model cavepeople','model-cavepeople','These miniature cavepeople came with a dinosaur model to show the scale of the dinosaur. I\'m not sure what model they came with originally tho.',2,NULL,0,0,NULL,'2010-02-15 05:07:20','2011-11-10 07:25:48'),(2128,NULL,2,'Dinosaur bath tub appliques','dinosaur-bath-tub-appliques','These have suction cups on their backs - you put them down in your bathtub so you don\'t slip.',0,NULL,0,0,NULL,'2010-02-15 23:49:13','2011-11-10 07:25:48'),(2129,NULL,2,'Time in Overdrive','time-in-overdrive','Time in Overdrive collection of Cadillacs and Dinosaurs comics.',0,NULL,0,0,NULL,'2010-02-28 14:08:07','2011-11-10 07:25:48'),(2130,NULL,7,'\"Stuff\"','stuff','By Leslie Ray Lewis. The items depicted is the \"stuff\" he surrounds himself with. He then fills in the background with hand-written script of his daily life. A journal, so to speak.',0,NULL,0,0,NULL,'2010-02-22 13:40:35','2011-11-10 07:25:48'),(2131,NULL,7,'Grasses','grasses','It\'s one of the few things I inherited from my mother. More sentimental value than anything else.',0,NULL,0,0,NULL,'2010-02-22 13:40:31','2011-11-10 07:25:48'),(2132,NULL,7,'\"Changes\"','changes','If you rotate a piece of cellophane it will change color. This has many layers of cellophane positioned to create the illusion of movement. The light box behind contains a circular fluorescent lamp with a motor that turns a disc of light bending material at 1 rpm. There are four pictures taken 6 seconds apart.',0,NULL,0,0,NULL,'2010-02-28 09:36:53','2011-11-10 07:25:48'),(2133,NULL,7,'\"A New Member\" by Jonathan Winters','a-new-member-by-jonathan-winters','Johnathan Winters has painted about 150 pictures in his second life as an artist. Jonathan Winters had a fear of the Klan. This was his way of saying that the Klan could use some new members. Fairly primitive but reeks of emotion.',2,NULL,0,0,NULL,'2010-02-28 21:11:30','2011-11-10 07:25:48'),(2134,NULL,7,'Midnight on the plains','midnight-on-the-plains','Look closely at the tree.',0,NULL,0,0,NULL,'2010-02-23 07:22:52','2011-11-10 07:25:48'),(2135,NULL,7,'Changes #2','changes-2','',0,NULL,0,0,NULL,'2010-02-25 03:35:49','2011-11-10 07:25:48'),(2136,NULL,7,'\"Birds of Paradise\"','birds-of-paradise','Original pencil drawing. Super photorealistic work by Scott Fitzgerald.',0,NULL,0,0,NULL,'2010-02-25 15:58:51','2011-11-10 07:25:48'),(2137,NULL,2,'Tyrannosaurus skeleton','tyrannosaurus-skeleton','Wooden Tyrannosaurus skeleton model',0,NULL,0,0,NULL,'2010-02-28 02:10:49','2011-11-10 07:25:48'),(2138,NULL,2,'Horizon Jurassic Park T-rex Model','horizon-jurassic-park-t-rex-model','Horizon Jurassic Park T-rex vinyl model.',0,NULL,0,0,NULL,'2010-02-28 16:48:16','2011-11-10 07:25:48'),(2139,NULL,7,'\"Who Shot Burns\"','who-shot-burns','When this cell was issued the right hand opening contained a big question Mark. They sent a box and filled it in after the season opener.',0,NULL,0,0,NULL,'2010-02-21 00:02:14','2011-11-10 07:25:48'),(2140,NULL,2,'Wooden Pteranodon model','wooden-pteranodon-model','Wooden Pteranodon skeleton model.',0,NULL,0,0,NULL,'2010-02-27 10:56:15','2011-11-10 07:25:48'),(2141,NULL,7,'Ego shot','ego-shot','We commissioned an artist to do an ego shot after I finished building my house. I spent 7 days a week for 2.5 years working on it before we moved into it.',0,NULL,0,0,NULL,'2010-02-20 23:25:05','2011-11-10 07:25:48'),(2142,NULL,2,'Wooden Tyrannosaurus model','wooden-tyrannosaurus-model','Wooden Tyrannosaurus skeleton model.',0,NULL,0,0,NULL,'2010-02-27 10:56:21','2011-11-10 07:25:48'),(2143,NULL,2,'Horizon Jurassic Park Brachiosaurus model','horizon-jurassic-park-brachiosaurus-model','Horizon Jurassic Park Brachiosaurus vinyl model.',2,NULL,0,0,NULL,'2010-02-28 18:59:14','2011-11-10 07:25:48'),(2144,NULL,2,'Wooden Stegosaurus skeleton model','wooden-stegosaurus-skeleton-model','Wooden Stegosaurus skeleton model.',0,NULL,0,0,NULL,'2010-02-27 10:56:06','2011-11-10 07:25:48'),(2145,NULL,2,'The Flintstones on a Picnic','the-flintstones-on-a-picnic','The Flintstones on a Picnic (with Dino)',0,NULL,0,0,NULL,'2010-02-23 01:38:26','2011-11-10 07:25:48'),(2146,NULL,7,'Changes #3','changes-3','Another phase',0,NULL,0,0,NULL,'2010-01-08 02:02:49','2011-11-10 07:25:48'),(2147,NULL,7,'\"Paper Parrots\"','paper-parrots','This is not a painting. It is torn bits of paper .',0,NULL,0,0,NULL,'2010-01-06 15:09:39','2011-11-10 07:25:48'),(2148,NULL,7,'Still life','still-life','The attention to detail makes some of the fruit appear translucent. The artist is Baker.',0,NULL,0,0,NULL,'2009-11-29 06:57:10','2011-11-10 07:25:48'),(2149,NULL,7,'\"Detroit Alley\"','detroit-alley','This is an incredibly detailed water color. As you dim the lights the stairs shadows get larger.',0,NULL,0,0,NULL,'2009-11-29 07:49:35','2011-11-10 07:25:48'),(2150,NULL,7,'\"Pensive\"','pensive','We commissioned automotive artist Gerald Freeman to do a painting commorating our \"Best of Class\" at the Meadow Brook Concours in 2004. We went back to the Matilda Dodge mansion and shot lots of pictures. We selected one and had him turn it into a painting.',0,NULL,0,0,NULL,'2010-01-02 18:09:12','2011-11-10 07:25:48'),(2151,NULL,7,'\"Lizard\"','lizard-81091e','Water color by island artist.',0,NULL,0,0,NULL,'2010-01-07 22:36:45','2011-11-10 07:25:48'),(2152,NULL,7,'\"Reflections\"','reflections','Jan miller Makes things appear three-dimensional.',0,NULL,0,0,NULL,'2010-02-24 23:55:07','2011-11-10 07:25:48'),(2153,NULL,7,'Yellowstone photographs','yellowstone-photographs','Taken by a neighbor as a young man exploring Yellowstone in the \'30s.',0,NULL,0,0,NULL,'2010-02-05 19:41:11','2011-11-10 07:25:48'),(2154,NULL,7,'Alley scene','alley-scene','This is a three dimensional cutout.',0,NULL,