 well that his works are almost indistinguishable from photographs.',0,NULL,0,0,NULL,'2010-03-01 01:59:07','2011-11-10 07:25:49'),(2177,NULL,7,'Hook rug','hook-rug','Took me two years to make this from a pattern. My wife is amazed that the back looks almost as good as the front.',0,NULL,0,0,NULL,'2010-02-26 17:19:00','2011-11-10 07:25:49'),(2178,NULL,7,'\"Exhausted\"','exhausted','By Dan McCrary. Original watercolor dealing with the reflections off of the exhaust manifold and spare tire cover from a \'20s Duesenberg.',0,NULL,0,0,NULL,'2010-02-27 12:26:57','2011-11-10 07:25:49'),(2179,NULL,7,'\"Surreal Harbor\"','surreal-harbor','Painting by husband and wife team. He paints the hard images and she paints the ephemeral images.',0,NULL,0,0,NULL,'2010-02-22 21:26:23','2011-11-10 07:25:49'),(2180,NULL,7,'\"Red Wine\"','red-wine','Painting by South American artist Homero Aguilar. Google his name for some of his exciting works. Note all the mirrors in this picture. You can see the entire room, except for the area where the artist is standing. He started as a surrealist and got real.',0,NULL,0,0,NULL,'2010-02-22 09:59:47','2011-11-10 07:25:49'),(2181,NULL,7,'\"Trunk lid\"','trunk-lid','At a Concours we walked up to our Mark II convertible as automotive artist Tom Hale was taking pictures of it. This original work is done in acrylics on canvas.',0,NULL,0,0,NULL,'2010-03-01 04:05:54','2011-11-10 07:25:49'),(2182,NULL,7,'\"Adam\'s dad\"','adams-dad','Another piece by Adam Tetzloff',0,NULL,0,0,NULL,'2010-02-25 05:40:39','2011-11-10 07:25:49'),(2183,NULL,7,'\"Kitchen Wares\"','kitchen-wares','By Jan Miller',0,NULL,0,0,NULL,'2010-02-25 21:09:15','2011-11-10 07:25:49'),(2184,NULL,1,'\'Infinite Crisis\' Wonder Woman','infinite-crisis-wonder-woman','==',0,NULL,0,0,NULL,'2010-02-28 08:20:57','2011-11-10 07:25:49'),(2185,NULL,1,'\'Wonder Woman\'','wonder-woman-89e1dd','From \'Wonder Woman\' Series 1, by DC Direct',1,NULL,0,0,NULL,'2010-02-28 04:33:01','2011-11-10 07:25:49'),(2186,NULL