,NULL,3,'1960 Rome Olympics Map','1960-rome-olympics-map','From the Automobilia Club D\'Italia. XVII Olimpiade, Roma',0,NULL,0,0,NULL,'2008-11-09 05:53:15','2011-11-10 07:26:18'),(2687,NULL,3,'1967 Great Lakes Shakespeare Festival','1967-great-lakes-shakespeare-festival','These small paper calendar of plays must have been given out like candy in the summer of \'67 as the box of travel stuff has lots of these.',0,NULL,0,0,NULL,'2008-11-09 05:55:42','2011-11-10 07:26:18'),(2688,NULL,3,'Retro Dodger Stadium Postcard','retro-dodger-stadium-postcard','Home of the Los Angeles Dodgers 1966 National League Champions. Unused.',0,NULL,0,0,NULL,'2008-11-09 05:57:31','2011-11-10 07:26:18'),(2689,NULL,3,'1962 Prince Of Wales Hotel Menu','1962-prince-of-wales-hotel-menu','Typed in blue on card stock with the hotel\'s nifty crown logo. Dated 3/8/62.',0,NULL,0,0,NULL,'2008-11-09 05:59:17','2011-11-10 07:26:18'),(2690,NULL,3,'Retro Cleveland Ohio Greyhound Terminal Postcard','retro-cleveland-ohio-greyhound-terminal-postcard','So cool, I can almost smell the exhaust from the buses.',0,NULL,0,0,NULL,'2008-11-09 06:02:46','2011-11-10 07:26:18'),(2691,NULL,3,'Pat Boone &amp; Amin Brothers Postcard','pat-boone-amp-amin-brothers-postcard','Playing in the Circus Room Theater Restaurant of John Ascuaga\'s Nugget in Reno. Unused & minty (and I have an extra one to share/trade/sell)',0,NULL,0,0,NULL,'2008-11-09 06:05:58','2011-11-10 07:26:18'),(2692,NULL,3,'Retro Pink Table Topper','retro-pink-table-topper','Minimum charge for sitting at the table was $6.50 plus tax, per person -- I have no idea where this was, but from the 1960s.',0,NULL,0,0,NULL,'2008-11-09 06:08:24','2011-11-10 07:26:18'),(2693,NULL,3,'Retro Reno Arch Postcard','retro-reno-arch-postcard','Love all the retro neon signs on this postcard. Unused.',0,NULL,0,0,NULL,'2008-11-09 06:22:01','2011-11-10 07:26:18'),(2694,NULL,3,'Instant Replay The Green Bay Diary of Jerry Kramer','instant-replay-the-green-bay-diary-of-jerry-kramer','Paperback copy of \"Instant Replay: The Green Bay Diary of Jerry Kramer\", edited by Dick Schapp, photographs by John and Vernon J. Biever. Signet Book,© 1968, third printing. Out of print classic for NFL and Packer fans. Conditions: Modest wear, sound binding, no markings. Pages are yellowing due to age.',0,NULL,0,0,NULL,'2008-11-09 06:49:56','2011-11-10 07:26:18'),(2695,NULL,3,'Vintage Chalkware Tom the Piper\'s Son','vintage-chalkware-tom-the-pipers-son','A vintage chalkware piece, circa 1940\'s (no later than the 50\'s is our best guess), this is Tom Tom The Piper\'s Son. Complete with portly pig and prancing pup -- they are on the run! An estate find, this piece has a few paint flakes, a flea bite and a chip at the base (by the word \'Son\') We\'ve taken many close-up photos, so please look at them. In our opinion these do not detract from this rare bit of nursery rhyme history, but rather add charm and authenticity to the piece. The winner will be proud to display this whimsical figurine. No marks for maker. Stands 6.25 inches tall. Base is 4 inches in diameter.',0,NULL,0,0,NULL,'2008-11-09 07:15:41','2011-11-10 07:26:18'),(2696,NULL,3,'Giant Plaster German Shepherd','giant-plaster-german-shepherd','A GSD with broken off ears.',0,NULL,0,0,NULL,'2008-11-09 07:20:25','2011-11-10 07:26:18'),(2697,NULL,3,'Plaster Mermaids','plaster-mermaids','A pair of mermaids on the wall.',0,NULL,0,0,NULL,'2008-11-09 07:21:36','2011-11-10 07:26:18'),(2698,NULL,3,'Floral Plaster Wall Hangings','floral-plaster-wall-hangings','Plaster/chalk floral wall grouping in kitchen.',0,NULL,0,0,NULL,'2008-11-09 07:23:01','2011-11-10 07:26:18'),(2699,NULL,3,'Small Red Chalk Dog','small-red-chalk-dog','Just a funny little pup.',0,NULL,0,0,NULL,'2008-11-09 07:24:02','2011-11-10 07:26:18'),(2700,NULL,3,'Pair Of Vintage Cala Lily Chalk Lamps','pair-of-vintage-cala-lily-chalk-lamps','An estate find, these pretty pair of boudoir lamps are made of chalk or plaster molded & painted to look like cala lilies. Nearly 13 inches tall (to top of fixture), 5 inches side at the base, about 6 inches wide at the sides part of the floral arrangement. Yes, the lamps work! These lamps are primarily antique white (creme colored), with each lily having it\'s center painted a warm yellow. Oval bases are painted metalic gold, as are several accents on the lilies. These are not the cold representations of cala lilies done in the 80\'s -- these are warm & feminine. They are finished, front & back, so there is no \'bad side\' to hide! Conditions: Use, vintage item, but no chips, cracks or repairs. One of the lamps has this spot, which is not a chip. It appears to be a manufacturing flaw, an extra drop of paint, & we show it so you can see it. These are quite charming lamps, & very unique. They would be wonderful in homes with romantic or shabby n chic decors -- they are feminine, but not overly frilly.',0,NULL,0,0,NULL,'2008-11-09 07:26:56','2011-11-10 07:26:18'),(2701,NULL,3,'Pair of White Poodle Head Plaques','pair-of-white-poodle-head-plaques','A pretty pair of poodle pups in plaster (say that 5 times faster!) Made by Miller Studio Inc, dated 1978. (Stamped along the top edge.) French poodle heads in white with black & gold painted accents like the gold collars; one male, one female. Each is 6 inches tall. The male is missing his \'staple\' hanger',0,NULL,0,0,NULL,'2008-11-09 07:31:03','2011-11-10 07:26:18'),(2702,NULL,3,'Antique Chalkware Grecian Relief Vase','antique-chalkware-grecian-relief-vase','Old chalkware vase, with a classic Grecian relief design. Chipped paint, a few cracks, and one arm broken off. To me it just adds to the authenticity and charm of an old piece. May date from the 1870’s, or considering the resurgence of such designs, perhaps from the 1920’s or 30’s. (I say it feels like the 1800’s, but then I just love it.)',0,NULL,0,0,NULL,'2008-11-09 07:37:43','2011-11-10 07:26:19'),(2703,NULL,3,'Bertha &amp; Tina Postcard','bertha-amp-tina-postcard','John Ascuaga