nal and Farmer\'s Wife Magazine','farm-journal-and-farmers-wife-magazine','February 1943',1,NULL,0,0,NULL,'2008-12-01 19:19:37','2011-11-10 07:26:27'),(2795,NULL,2,'Famemaster Amargasaurus','famemaster-amargasaurus','This is a very nice figure that comes as a puzzle that you have to build.',1,NULL,0,0,NULL,'2008-12-03 07:46:32','2011-11-10 07:26:28'),(2796,NULL,2,'3 Dino Packs Dinosaurs','3-dino-packs-dinosaurs','These are the contents of one of my Dino Packs: Spinosaurus, Dilophosaurus, and Baby T-rex.',0,NULL,0,0,NULL,'2008-12-03 11:51:51','2011-11-10 07:26:28'),(2797,NULL,2,'3 More Dino Packs Dinosaurs','3-more-dino-packs-dinosaurs','These are the contents of another Dino Pack: Stegosaurus, Velociraptor, and Ankylosaurus.',0,NULL,0,0,NULL,'2008-12-03 11:51:51','2011-11-10 07:26:28'),(2798,NULL,2,'Dino Packs Instructions','dino-packs-instructions','This is part of the instruction sheet from the Dino Packs. It shows all of the dinosaur figures that were available. According to the sheet there were 18 available to collect: Dilophosaur, Tyrannosaurus Rex, Baby Tyrannosaurus Rex, Velociraptor, Spinosaurus, Compsognathus, Dimetrodon, Triceratops, Baby Triceratops, Stegosaurus, Baby Stegosaurus, Chasmosaurus, Brachiosaur, Pachycephalosaurus, Parasaurolophus, Ankylasaurus [sic], Pteranodon, and Gallimimus',0,NULL,0,0,NULL,'2008-12-03 11:51:51','2011-11-10 07:26:28'),(2799,NULL,2,'2008 Figures','2008-figures','I bought these figures in a wholesale lot over Thanksgiving weekend 2008. They are made from the same molds as the Dino Packs figures! They are much cheaper, are painted differently and do not have the JPIII logo on them. There are 12 different ones: Pteranodon, Brachiosaur, Stegosaurus, Dimetrodon, Velociraptor, Chasmosaurus, Triceratops, Tyrannosaurus, Spinosaurus, Dilophosaurus, Parasaurolophus, and Pachycephalosaurus. So I suppose that makes the Baby Tyrannosaurus Rex, Compsognathus, Baby Stegosaurus, and Ankylasaurus the rarest of them all because they were only available in the Dino Packs and they are not being made today.',0,NULL,0,0,NULL,'2008-12-03 11:53:09','2011-11-10 07:26:28'),(2800,NULL,2,'Dino Packs Packages','dino-packs-packages','These are two Dino Packs. They were sold in 2001 and I only ever saw them for sale at CVS. They were relatively expensive for what you got so that\'s why I only bought 2. They had mini dinosaur figures and instructions for some kind of game to play with them. The figures are actually very nice and I think underrated. The packs were sealed so you didn\'t know which figures you would get when you bought them.',0,NULL,0,0,NULL,'2008-12-03 11:53:09','2011-11-10 07:26:28'),(2801,NULL,2,'Jurassic Park III ATV','jurassic-park-iii-atv','Also in 2001, a series of 6 die-cast Jurassic Park III vehicles was released. Each contained one of the Dino Pack dinosaurs. This one is the ATV with Grappling Hook and baby Triceratops.',0,NULL,0,0,NULL,'2008-12-03 12:01:53','2011-11-10 07:26:28'),(2802,NULL,2,'Jurassic Park III Helicopter','jurassic-park-iii-helicopter','Jurassic Park III Helicopter with Net and Triceratops.',0,NULL,0,0,NULL,'2008-12-03 12:01:53','2011-11-10 07:26:28'),(2803,NULL,2,'Jurassic Park III Capture Transport','jurassic-park-iii-capture-transport','Jurassic Park III Capture Transport with Velociraptor.',0,NULL,0,0,NULL,'2008-12-03 12:01:53','2011-11-10 07:26:28'),(2804,NULL,2,'Jurassic Park III Pickup Truck','jurassic-park-iii-pickup-truck','Pickup Truck with Capture Rod and Pteranodon.',0,NULL,0,0,NULL,'2008-12-03 12:05:01','2011-11-10 07:26:28'),(2805,NULL,2,'Jurassic Park III Transport with Capture Cage','jurassic-park-iii-transport-with-capture-cage','Transport with Capture Cage and Dimetrodon.',0,NULL,0,0,NULL,'2008-12-03 12:05:02','2011-11-10 07:26:28'),(2806,NULL,2,'Jurassic Park III Mobile Command Center','jurassic-park-iii-mobile-command-center','Mobile Command Center with Gallimimus...so for those of you keeping track, there were 12 figures that were exclusive to the Dino 