tty-crockers-new-picture-cook-book','Betty Crocker book, printed in 1950 (my dear Grandma\'s copy -- has her additional tips scripted by recipes!)',0,NULL,0,0,NULL,'2009-01-01 07:32:48','2011-11-10 07:26:41'),(3000,NULL,3,'3 Vintage Recipe Booklets from Western Beet Sugar','3-vintage-recipe-booklets-from-western-beet-sugar','These three vintage booklets were produced by the Western Beet Sugar Producers, Inc, circa 1940\'s - 1950\'s. All three are by Nancy Haven, of the Consumer Service Department. Titles: Fashions in Frostings Well Preserved Just Desserts Each measures 5 x 3 inches. Conditions: Virtually like new!',2,NULL,0,0,NULL,'2009-01-01 07:35:34','2011-11-10 07:26:41'),(3001,NULL,3,'My Party Book of Tested Chocolate Recipes 1938','my-party-book-of-tested-chocolate-recipes-1938','My Party Book of Tested Chocolate Recipes, Easy Desserts and Refreshments with America\'s Favorite Flavor, Frances Lee Barton, 1938, General Foods. Second Printing Staple bound booklet, measuring 7 x 5.25 inches, with 26 pages (plus covers) featuring chocolate receipes to promote Baker\'s Chocolate and Bakers Cocoa, as featured inside the back cover. Black & white, includes photos and illustrations. Conditions: Front bottom corner torn, as shown. No writings (even the \'write your name\' spot is blank!). Spine is worn, small tear at spine bottom, but sound & intact. Nifty!',3,NULL,0,0,NULL,'2009-01-01 07:38:17','2011-11-10 07:26:41'),(3002,NULL,3,'Sentry Foods Julia Child Program Guides Recipes','sentry-foods-julia-child-program-guides-recipes','This lot includes three promotional program guides or cookbooks as well as a signed letter from Sentry Food Stores, Waukesha, Wisconsin, as listed and shown. Weekly Program Guide, Weekly Program Recipes, brought to you by WMVS, Channel 10 Milwaukee, and Sentry Food Stores. These program guides include the date & description of the cooking shows and of course Julia Child\'s recipes for the shows. They measure 8.5 x 10.5 inches, are staple bound, with approx 58 pages. The French Chef Julia Child, 1966-197 Television Season (Sixth Series) The French Chef Julia Child, 1966-197 Television Season (Sixth Series Continues Plus Seventh Series) \"The Best of Julia\" French Cooking 1967-1968 All three books have some cover wear, a few chips on corners etc, however the staple bindings & all pages are intact. The do have notes neatly scripted inside in various places, as well as a few note pages \'included\' by the previous owner. The letter is on Sentry Food Stores stationary, from the offices located at1200 W. Sunset Drive, Waukesha, Wisconsin, and is dated October, 27, 1967. It is to Mrs. Joe Rakum, thanking her for her comments on the French Chef Program, and mentioning that they are including the recipe booklet. It is signed Thomas E. Manders, Marketing Services Manager -- signed ie -- so perhaps the secretary? The letter is in wonderful shape, with some edge chipping as it was stored tucked inside one of the guides.',0,NULL,0,0,NULL,'2009-01-01 07:43:21','2011-11-10 07:26:41'),(3003,NULL,3,'EHP Waterless Cookbook','ehp-waterless-cookbook','Nutritious Cooking The Waterless Way, a promotional cookbook for the \"scientific\" stainless steel cookware.',0,NULL,0,0,NULL,'2009-01-01 07:59:41','2011-11-10 07:26:41'),(3004,NULL,3,'Blue Ribbon Recipes - Amarillo Garden Club','blue-ribbon-recipes-amarillo-garden-club','The Amarillo Garden Club\'s Blue Ribbon Recipes book - the classic fund raiser cookbook, with lots of ads too (local as well as Borden\'s, Swans Down etc.)',0,NULL,0,0,NULL,'2009-01-01 08:02:57','2011-11-10 07:26:41'),(3005,NULL,1,'XII : Harpy (Unpainted)','xii-harpy-unpainted','==',1,NULL,0,0,NULL,'2009-01-06 23:12:52','2011-11-10 07:26:42'),(3006,NULL,1,'XII : Berith\'s Cat','xii-beriths-cat','Possibly - the translation was very shady.',0,NULL,0,0,NULL,'2009-01-06 23:12:52','2011-11-10 07:26:42'),(3007,NULL,1,'XII : Furfur','xii-furfur','http://en.wikipedia.org/wiki/Furfur',0,NULL,0,0,NULL,'2009-01-06 23:1