 as Mager. Measures 8 x 5.5 inches. Condition Bottom front cover corner missing (please view photo). A few pages are colored. Secure staple binding, no rust. Pages starting to tan with age. Overall very nice for an old child\'s coloring book.',0,NULL,0,0,NULL,'2009-08-19 14:02:15','2011-11-10 07:28:32'),(3600,NULL,13,'Crazy Magazine #4','crazy-magazine-4','For a short time in the early 1970\'s, Crazy magazine, a competitor of Mad and Cracked magazines was published by Marvel Comics. During this period Crazy magazine payed tribute to many Black celebrities in the area of film, music and television. Please visit The Museum Of UnCut Funk blog Can\'t Get Enough of that Funky Stuff to read more. www.funkystuffblog.com.',0,NULL,0,0,NULL,'2009-08-22 11:17:25','2011-11-10 07:28:34'),(3601,NULL,13,'Crazy Magazine #2','crazy-magazine-2','For a short time in the early 1970\'s, Crazy magazine, a competitor of Mad and Cracked magazines was published by Marvel Comics. During this period Crazy magazine payed tribute to many Black celebrities in the area of film, music and television. Please visit The Museum Of UnCut Funk blog Can\'t Get Enough of that Funky Stuff to read more. www.funkystuffblog.com.',0,NULL,0,0,NULL,'2009-08-22 11:17:26','2011-11-10 07:28:34'),(3602,NULL,13,'Untitled Item','untitled-item-5db89c','',0,NULL,0,0,NULL,'2009-08-22 11:44:52','2011-11-10 07:28:34'),(3603,NULL,13,'Lois Lane #106','lois-lane-106','?I am Curious (Black)” the first story in Superman’s Girlfriend Lois Lane #106. The Museum of UnCut Funk has acquired this comic book to our comic book collection. Please visit the Can\'t Get Enough of that Stuff blog to read more. www.funkystuffblog.com',0,NULL,0,0,NULL,'2009-08-22 11:45:34','2011-11-10 07:28:34'),(3604,NULL,1,'Futurama Mini box','futurama-mini-box','The retro box that the Futurama mini comes blind packaged in.',0,NULL,0,0,NULL,'2009-08-22 20:55:06','2011-11-10 07:28:35'),(3605,NULL,1,'Leela','leela','With sunglass. 2/16 ratio.',0,NULL,0,0,NULL,'2009-08-22 20:55:06','2011-11-10 07:28:35'),(3606,NULL,1,'Futurama Minis case','futurama-minis-case','A case of 16 Futurama minis.',0,NULL,0,0,NULL,'2009-08-22 20:55:06','2011-11-10 07:28:35'),(3607,NULL,1,'Zoidberg','zoidberg','With stethoscope. 2/16 ratio.',0,NULL,0,0,NULL,'2009-08-22 20:57:10','2011-11-10 07:28:35'),(3608,NULL,1,'Mom','mom','With Electro-Cutie Kitty. 2/16 ratio.',0,NULL,0,0,NULL,'2009-08-22 20:57:10','2011-11-10 07:28:35'),(3609,NULL,1,'Robot Devil','robot-devil','With solid gold fiddle. 1/96 ratio, the rarest piece.',0,NULL,0,0,NULL,'2009-08-22 20:57:11','2011-11-10 07:28:35'),(3610,NULL,1,'Nibbler','nibbler','With chicken and food bowl. 2/16 ratio.',1,NULL,0,0,NULL,'2009-08-22 20:58:05','2011-11-10 07:28:35'),(3611,NULL,1,'Morbo','morbo','With vein cream. 1/16 ratio.',0,NULL,0,0,NULL,'2009-08-22 20:58:05','2011-11-10 07:28:35'),(3612,NULL,1,'Futurama Minis case : Open','futurama-minis-case-open','==',0,NULL,0,0,NULL,'2009-08-22 20:58:05','2011-11-10 07:28:35'),(3613,NULL,1,'Fry','fry','With 20th century pizza box. 2/16 ratio.',0,NULL,0,0,NULL,'2009-08-22 20:59:17','2011-11-10 07:28:35'),(3614,NULL,1,'Zapp Brannigan','zapp-brannigan','With book. 2/16 ratio.',0,NULL,0,0,NULL,'2009-08-22 20:59:17','2011-11-10 07:28:35'),(3615,NULL,1,'Sal','sal','With box of Bachelor Chow. Rare figure, ratio undetermined.',1,NULL,0,0,NULL,'2009-08-22 20:59:18','2011-11-10 07:28:35'),(3616,NULL,1,'Futurama case distribution','futurama-case-distribution','This is the order in which the minis were laid out in the case. Doubles all were next to one another, so when choosing, go for the diagonals.',0,NULL,0,0,NULL,'2009-08-22 21:00:33','2011-11-10 07:28:35'),(3617,NULL,1,'Bender','bender','With cigar & Egyptian mask. 2/16 ratio.',0,NULL,0,0,NULL,'2009-08-22 21:00:33','2011-11-10 07:28:35'),(3618,NULL,3,'Vintage Wooden Recipe Scrapbook','vintage-wooden-recipe-scrapbook','Wooden boards with black & white painted domestic kitchen scene. Plastic rings in 3-ring punch-esque holes with fragile old paper to glue & write recipes in. Four pages with glued recipes -- loose, no longer attached to rings. Lots of blank (and tanning) pages. Measures approximately 10 x 8 inches.',0,NULL,0,0,NULL,'2009-08-25 15:16:36','2011-11-10 07:28:37'),(3619,NULL,3,'Art of the Potter by William Bowyer Honey','art-of-the-potter-by-william-bowyer-honey','The Art of the Potter: A Book for the Collector and Connoisseur by William Bowyer Honey, Beechhurst Press, 1955. Concise and invaluable manual for the collector and connoisseur of pottery. I. Introduction: The Collector and the Community II. Notes on the Technique and Aesthetics of Pottery, including materials, process, form, decoration, figure modeling & color. III. Three types of Excellence in Pottery, including Corean Wares of the Yi Dynasty, the beginnings of Porcelain in Europe & Modern English Pottery & porcelain. And an Index. Many black & white photos of pottery pieces -- 160 plates. Some names, periods and makers included: prehistoric pottery, Doulton & Co., Lambeth, Joseph Bourne & Son, Perian, Greek, Italian, Faenza, Staffordshire, African, Thuringian, Chinese, Ludwigsburg, Meissen, figurines, tableware, earthenware, Wedgewood and many more. First U.S. edition. Hardcover, measuring nearly 10 inches x 6.25 inches, 111 pages. Sound binding, minimal wear to boards. Free ned pages starting to tan. Old price written on inside front flap of jacket. No other writings or markings found. Dustjacket has chips, please see photo & contact if you have questions!',0,NULL,0,0,NULL,'2009-08-25 17:22:48','2011-11-10 07:28:37'),(3620,NULL,3,'1950s Full Apron Pattern','1950s-full-apron-pattern','Advance printed pattern number 8163 Full apron, with bib top and full pockets, circa 1950s. Pattern is cut, but in fine shape. All pieces & instruction sheet included. Size Medium',0,NULL,0,0,NULL,'2009-08-25 17:52:03','2011-11-10 07:28:37'),(3621,NULL,3,'Adorable Vintage Girls Dress Pattern','adorable-vintage-girls-dress-pattern','Butterick number 4215 - a one-piece girls dress with inverted pleats in front & back. Options: A high yoke with either a high scoop neckline or a large Peter Pan collar, A short or full lenght sleeves. She\'ll be even more adorable than ever! Size 3, breast 22. Conditions: Complete & neat. Cut, but does not appear used. Envelope is also in lovely shape. Authentic vintage pattern, not a copy!',0,NULL,0,0,NULL,'2009-08-25 17:57:56','2011-11-10 07:28:37'),(3622,NULL,3,'Simplicity Toddler\'s Bathing Suits &amp; Cover Up','simplicity-toddlers-bathing-suits-amp-cover-up','Charming collection of toddler beachwear: Girls\' Bathing Suit (top & panties), Boy\'s Bathing Suit (shorts), and Overblouse (coverup). Simplicity pattern No 6520, © 1968, Toddler Size 2. Pattern is complete, including transfer for the fish applique.',0,NULL,0,0,NULL,'2009-08-25 18:07:50','2011-11-10 07:28:37'),(3623,NULL,3,'Smurf King for a Day Smurf Puppet Book','smurf-king-for-a-day-smurf-puppet-book','Smurf King for a Day: a Puppet Book copyright 1983 by Peyo The PaPa Smurf puppet is attached to the back cover of the book. There is a die-cut opening on all of the pages which the fabric puppet appears through. Harcover book with thicker pages, measures 7 1/4 x 9 1/4 inches. Conditions: Gently used condition. A nice find for the collector!',0,NULL,0,0,NULL,'2009-08-25 18:51:32','2011-11-10 07:28:37'),(3624,NULL,3,'Vintage Sun Rubber Squeaky Doll Tod-L-Tim','vintage-sun-rubber-squeaky-doll-tod-l-tim','Tod-L-Tim has molded painted hair, a one-piece bodysuit or underwear, socks & shoes. His brown eyes are plastic inserts, his mouth his opened. The details on this Tod-L doll are really nice, even if the relatively \'sloppy\' mold lines are rather obvious. Still soft, no tears & still squeaks! Tim needs a bath, but it\'s been a long time since he\'s had proper care. Measures 10.25 inches tall. On the bottom of this right foot it reads: TOD-L-TIM © The Sun Rubber Co, Barberton, O (for Ohio) U.S.A.',1,NULL,0,0,NULL,'2009-08-25 19:04:53','2011-11-10 07:28:37'),(3625,NULL,3,'Dollspart Catalog 1977-1978','dollspart-catalog-1977-1978','Dollspart, Anything and Everything for Dolls, catalog, 1977-1978. Inventory/stock numbers and black and white images for \'anything and everything for dolls\' in \'77 and \'78. Includes wigs, doll house miniatures furniture kits, pressed faces, antique doll replicas, reproduction kits, doll shoes, doll clothes, glass eyes, stuffed bodies etc., as well as bisque, composition and china parts. Nifty for the collector, creator, and repair person to identify parts. Top right corner crease/fold, previous owner\'s name on front cover, otherwise very clean and bright. Sound binding.',0,NULL,0,0,NULL,'2009-08-25 21:10:55','2011-11-10 07:28:37'),(3626,NULL,3,'Vintage Hollywood Doll Lucky Star Box &amp; Booklet','vintage-hollywood-doll-lucky-star-box-amp-booklet','Lovely box for Hollywood Dolls, with pretty blue stars & the company logo printed on it. If you\'ve got the doll, you want the box! The box & paper insert are the only parts included - no doll! Box measures 7.25 x 7.25 x 2.75 inches. It has the original silver lable with hot pink print which reads: A Hollywood Doll, Hollywood Lucky Star Series, Reg Trade Mark, with Horoscope for Saggittarius, Nov 22 to Dec 21, copyright 1944 by Hollwydoo Doll Mfg. Co, Glendale 1, California. The paper insert measures 5 x 3.5 inches, and lists all the series (presumably) of the time.',0,NULL,0,0,NULL,'2009-08-25 21:18:48','2011-11-10 07:28:37'),(3627,NULL,3,'Vintage Hollywood Doll Storybook - Fur Trim &amp; Muff','vintage-hollywood-doll-storybook-fur-trim-amp-muff','A very pretty hard plastic doll with working sleep eyes, painted eyelashes and shoes, in a lovely detailed outfit. She is 5 inches tall, has a pretty blonde hair, painted lips & lashes, and her arms & legs are jointed. Her tummy is \'pudgey\' not slim. She is 5 inches tall, has a pretty blonde hair, painted lips & lashes, and her arms & legs are jointed. Her tummy is \'pudgey\' not slim. Condition No cracks or breaks, limbs head & eyes all move appropriately. Her hair is mussed, but not damaged. Her little underpants are still taped, held together with a pin. On the bottoms of her little white painted shoes, a penciled number 7 on one, 0 on the other. No other flaws found.',0,NULL,0,0,NULL,'2009-08-25 21:22:47','2011-11-10 07:28:37'),(3628,NULL,3,'Vintage Little Dressmaker Box','vintage-little-dressmaker-box','The box for the Little Dressmaker kit. Made by De Luxe Game Corp, New York, the kit was considered an educational toy to teach young girls how to sew and make clothing - by making clothing for dolls. De Luxe Game Corp # 7131 - we are not certain of the year of this vintage item, dates range from the 30\'s to 50\'s. The box resembles a suitcase, with a latch & handle. This is for the box only - as collectors, we cannot bear to toss out boxes. Knowing we would scream in agony if someone threw away boxes for our goodies, we won\'t be ressponsible for the screams of others! Conditions: Hinge is intact (so this box is in one piece!), the latch works, the metal handle is also intact & strong. Bottom of the box has grease pencil writing (only 10 characters). There are some broken corners on the box lid, along with scuffs & paper lifts where the cardboard shows through. One tear on the lid, near latch (shown in the photo.) The graphics are bright & charming. Please view the photos, and ask questions!',0,NULL,0,0,NULL,'2009-08-25 21:28:34','2011-11-10 07:28:37'),(3629,NULL,3,'Retro Liddle Kiddle Doll?','retro-liddle-kiddle-doll','I think this dear it a Liddle Kiddle, however, she is not marked Mattel, but rather just has \"Made in Hong Kong\" on her back. There are no markings/information on the back of her head, and she wears the plastic panties which I did not wish to remove. She has auburn hair, blue eyes (looking to her right), and one pink blush marking on her right cheek. She stands just under 3 inches tall. Conditions: Head turns, plastic intact, one small \'smudge\' on her left cheek. Her hair looks as if it was originally in a ponytail, but seems fine.',0,NULL,0,0,NULL,'2009-08-25 21:42:26','2011-11-10 07:28:37'),(3630,NULL,3,'Vintage Embroidered Wool Felt Baby Booties','vintage-embroidered-wool-felt-baby-booties','This sweet pair of baby booties has lots of nice details. A soft cream color with pretty pastel floral embroidery along the top. Made of of wool felt, these booties have suede sole bottoms, ivory laces, and metal eyelets. Conditions: The right bootie has a few areas where moths had a picnic (see photo below), but properly placed on a doll, they may never be noticed. Slight wear to soles and tips of toes. No odor problems. Stuffed with tissue, these booties have been well cared for at the estate we found them at. Circa 1940\'s is our best guess.',0,NULL,0,0,NULL,'2009-08-25 21:45:33','2011-11-10 07:28:37'),(3631,NULL,3,'Antique Horsman Can\'t Break Em Doll','antique-horsman-cant-break-em-doll','This antique composition doll has a sawdust stuffed cloth body and jointed legs. We think this blue stripped outfit is the orginal. (It is held at the nape of the neck with a pin.) On the back of the neck this doll is marked EIH © 1911. After some thorough research, we believe this to be one of the Horsman Can\'t Break \'Em character dolls -- and also the first in the Gold Medal Baby series, its face having been created by Helen Fox Trowbridge. This head was sculpted in 1911 using her own one-year-old son, Mason Jr., as the model. This was the first time, the first in the series that Horsman called the Gold Medal Baby, that this mold was used. The doll measures 12 inches. We\'ve taken lots of photos to show conditions, including the broken fingertips on the right hand, the wear on the left foot (likely from some child\'s sucking, and the wear on the head. All the joints are flexible and move nicely. Overall, we are impressed with this old fragile doll\'s beauty & charm -- and we hope you are too because he needs a loving home!',0,NULL,0,0,NULL,'2009-08-25 21:53:57','2011-11-10 07:28:37'),(3632,NULL,3,'Original Jane West Figure Marx 1965','original-jane-west-figure-marx-1965','Jane West figure, turquoise with blond hair (red headband). This is the original \"short face\" version made by Marx in 1965. Vintage Jane West Action Figure Jane comes with her skirt and vest. She needs a bath has some scuffs (dusty trail and all that), and her skirt has a larger tear than the original opening, but it still fits and the waistband closes, but she\'s in good shape.',0,NULL,0,0,NULL,'2009-08-25 22:07:02','2011-11-10 07:28:37'),(3633,NULL,3,'What Do Doozers Do? ~ Fraggle Rock Book','what-do-doozers-do-fraggle-rock-book','A Fraggle Rock Book Starring Jim Henson\'s Muppets: What Do Doozers Do?, by Michaela Muntean, pictures by Sue Venning, copyright 1984 Muppet Press, Holt, Rinehart & Winston, New York. Hardcover, 8.25 square inches. Highly collectible book! Conditions Modest wear to covers, sound binding. A few scuff marks inside front board, but no writings or rips. Nice!',0,NULL,0,0,NULL,'2009-08-25 22:35:22','2011-11-10 07:28:37'),(3634,NULL,3,'Ruth Dixon Little Friends ~ Real Live Animal Book','ruth-dixon-little-friends-real-live-animal-book','Sit down, this is so cute, you won\'t be able to stand it! Little Friends: Kittens, Puppies, Bunnies, written by Ruth Dixon, photographs by Rie Gaddis, copyright 1951 by Rand McNally & Company, Chicago. This is the \'U.S.A. Edition of 1962.\' Elf Book # 8408 (8408:25 on back) Absolutely adorable illustrations ~ I mean, just look at \'em! Why are those pictures so darn cute?! Glad you asked! They are so darn adorable because this is one of the books from the series using real photographs ~ A Real Live Animal Book. \"The remarkable photographs of real, live animals in LITTLE FRIENDS: KITTENS, PUPPIES, BUNNIES were made by the well-known photographer, Miss Rie Gaddis. It was only by use of unlimited patience and extremely genlte care with the animals at all tmes that Miss Gaddiss was able to achieve these unusual pictures.\" (That\'s how they used to say \'No animals were harmed in the production of this book!) Anyway, this book ~ and the other one we have listed now ~ can be yours to treasure, either as an old lost friend, or a new one! Condition Preivious owner\'s name inside front cover (\'Blake\' in what looks like colored pencil). No other marks. No rips. Crisp pages, but they are starting to tan with age. Sound binding. Minimal wear to cover boards. In super collectible shape!',1,NULL,0,0,NULL,'2009-08-25 22:44:04','2011-11-10 07:28:37'),(3635,NULL,3,'Harvey the Invisible Rabbit Coloring Book','harvey-the-invisible-rabbit-coloring-book','Harvey the Invisible Rabbit\'s Own Coloring Book, Authorized Edition, The Saalfield Publishing Company, Akron, Ohio, New York. A cute coloring book based upon the character from the Jimmy Stewart movie -- or, as printed on the title page: \"HARVEY is an invisible rabbit, but he can be seen in this book by all good children! HARVEY is 6 feet, 1 1/2 inches tall with his ears down! HARVEY has come straight from New York City where he is the leading character in the Pulitzer Prize Play written by Mary Chase. In that play he delights hundreds of thousands of people. Now he comes to delight children all over this land in this brand new coloring book!\" Measures 15 x 9 inches. Conditions: Cover wear, including tears, mostly on back cover, please view photos. Most pages are colored. Staple bound, but not all pages are secure. No credits for artist; no year or copyright listed. The cover has a \'3\' printed on it, lower left -- where the tear is, so the number likely is not complete. Based on the text quoted above, this seems to predate the film. Please, contact us with questions!',0,NULL,0,0,NULL,'2009-08-25 22:54:30','2011-11-10 07:28:37'),(3636,NULL,13,'Coal Black and the Sebben Dwarfs','coal-black-and-the-sebben-dwarfs'