(3729,NULL,3,'Vintage Alan Jay Clarolyte Tiger With Bottle','vintage-alan-jay-clarolyte-tiger-with-bottle','Vintage Clarolyte rubber squeaky toy by Alan Jay (marked on back, see other photos). Baby tiger holding a baby bottle -- looks a lot like a baby Tony the Tiger! Stands 7.25 inches tall. Still squeaks, but squeaker hole covering is no longer perfect. Signs of wear, including paint rubbings; see photos and ask questions.',1,NULL,0,0,NULL,'2009-09-02 03:26:44','2011-11-10 07:28:40'),(3730,NULL,3,'Retro Sawdust Stuffed Flirty Octopus!','retro-sawdust-stuffed-flirty-octopus','What a wild, flirty female octopus! She winks, she\'s got kissy lips, a jaunty hat, and a seed bead necklace too! Velvety red sawdust stuffed retro octopus with applique facial features. Some of her legs contain wires, so you can pose them! Appears as if the top of her hat is missing a \'lid\' (perhaps she flipped it with all that flirting?) so you can see the top of her head. One tentacle has worn/threadbare spot. Green stitch on raised tentacle suggests she may have once held something. Otherwise, modest signs of wear/age. Measures approximately 5 inches tall.',0,NULL,0,0,NULL,'2009-09-02 04:47:31','2011-11-10 07:28:40'),(3731,NULL,3,'Vintage Rubber Face Black &amp; White Bear','vintage-rubber-face-black-amp-white-bear','Little plus bear with an adorable rubber or masked face with molded lines for more hair/fur and other facial features. \'She\' has black eyes (with blue shadow/shading), which peer to her left. The mouth is slightly open, showing some teeth. This vintage plush or stuffed bear has no tags, so I don\'t know who made her -- Knickerbocker, Rushton, or My Toy maybe? -- but if you do, please do tell! She has been repaired/resewn at the back of her neck. Red satin ribbon appears original. Painting in nice shape, fur is soft. Does sit by herself too. Approximately 8 inches tall.',0,NULL,0,0,NULL,'2009-09-02 05:15:32','2011-11-10 07:28:40'),(3732,NULL,3,'Big Toe Joe','big-toe-joe','Retro handmade doll. Folk art? Maybe. But a well-loved toy for sure.',0,NULL,0,0,NULL,'2009-09-02 06:34:34','2011-11-10 07:28:40'),(3733,NULL,3,'How To Be Your Own Decorator','how-to-be-your-own-decorator','By Helen Koues, Director of Good Housekeeping Studio, copyright 1926 by Good Housekeeping Magazine, second edition, printed April, 1927,',0,NULL,0,0,NULL,'2009-09-02 06:53:02','2011-11-10 07:28:40'),(3734,NULL,1,'4245 : Warriors','4245-warriors','Five different Egyptian Warriors in one set, plus weapons and a horse!',0,NULL,0,0,NULL,'2009-09-10 05:28:11','2011-11-10 07:28:46'),(3735,NULL,1,'4340 : Pyramid (Boxed)','4340-pyramid-boxed','Gigantic playset with openable sides, a pharaoh, treasures, guards, and many secret passages and trap doors. Very awesome.',0,NULL,0,0,NULL,'2009-09-10 05:28:12','2011-11-10 07:28:46'),(3736,NULL,1,'4244 : Chariot Horses','4244-chariot-horses','Two identical horses.',0,NULL,0,0,NULL,'2009-09-10 05:28:12','2011-11-10 07:28:46'),(3737,NULL,1,'4246 : Tomb - Inside','4246-tomb-inside','Two tomb raiders in a barren tomb. Little do they know, the treasure is in a false wall.',0,NULL,0,0,NULL,'2009-09-10 05:31:28','2011-11-10 07:28:46'),(3738,NULL,1,'4243 : Pharaoh\'s Temple','4243-pharaohs-temple','Dude\'s getting carried around in a fancy chair!',0,NULL,0,0,NULL,'2009-09-10 05:31:28','2011-11-10 07:28:46'),(3739,NULL,1,'4240 : Pyramid w/ open sides','4240-pyramid-w-open-sides','Comes with three sides that can be affixed to any side of the Pyramid structure. The inside has \'adventure\' features on all four sides.',0,NULL,0,0,NULL,'2009-09-10 05:31:29','2011-11-10 07:28:46'),(3740,NULL,1,'4246 : Tomb with Treasure (boxed)','4246-tomb-with-treasure-boxed','With openable roof, gold nuggets, camel, two figures, a scorpion & even a working-ish well.',0,NULL,0,0,NULL,'2009-09-10 05:34:42','2011-11-10 07:28:46'),(3741,NULL,1,'4246 : Tomb with false wall &amp; dog','4246-tomb-with-false-wall-amp-dog','Lots of hidden treasure can be found inside the tom\'s false wall!',0,NULL,0,0,NULL,'2009-09-10 05:34:42','2011-11-10 07:28:46'),(3742,NULL,1,'4242 : Sphinx - Mummy &amp; accessories','4242-sphinx-mummy-amp-accessories','Each larger playset includes a key to activate special features. It\'s not necessary, but it\'s neat. This is also the second treasure-clad skeleton in the set, and I can NEVER have enough Playmobil skeletons!',0,NULL,0,0,NULL,'2009-09-10 05:34:42','2011-11-10 07:28:46'),(3743,NULL,1,'4244 : Chariot driver','4244-chariot-driver','A well-adorned driver for the chariot!',0,NULL,0,0,NULL,'2009-09-10 05:36:29','2011-11-10 07:28:46'),(3744,NULL,1,'Egyptian sets combined','egyptian-sets-combined','',0,NULL,0,0,NULL,'2009-09-10 05:36:29','2011-11-10 07:28:46'),(3745,NULL,1,'4340 : Pyramid inner tomb','4340-pyramid-inner-tomb','Includes sarcophagus and two secret panels that slide open.',0,NULL,0,0,NULL,'2009-09-10 05:36:30','2011-11-10 07:28:46'),(3746,NULL,1,'4340 : Pyramid tomb raider','4340-pyramid-tomb-raider','Fighting off four scorpions, and about to face a mummy!',0,NULL,0,0,NULL,'2009-09-10 05:37:24','2011-11-10 07:28:46'),(3747,NULL,1,'Egyptian sets combined','egyptian-sets-combined-deefbd','==',0,NULL,0,0,NULL,'2009-09-10 05:37:24','2011-11-10 07:28:46'),(3748,NULL,1,'Egyptian sets combined','egyptian-sets-combined-344fe8','==',0,NULL,0,0,NULL,'2009-09-10 05:37:25','2011-11-10 07:28:46'),(3749,NULL,1,'4247 : Two Robbers','4247-two-robbers','--',0,NULL,0,0,NULL,'2009-09-10 05:39:20','2011-11-10 07:28:46'),(3750,NULL,1,'4340 : Pyramid trap stairs','4340-pyramid-trap-stairs','Press the blue button and the stairs collapse!',0,NULL,0,0,NULL,'2009-09-10 05:39:20','2011-11-10 07:28:46'),(3751,NULL,1,'4246 : Tomb with Treasure pieces','4246-tomb-with-treasure-pieces','A surprising number of bits go into this set.',0,NULL,0,0,NULL,'2009-09-10 05:39:20','2011-11-10 07:28:46'),(3752,NULL,1,'4243 : Pharaoh\'s Temple with secret panels','4243-pharaohs-temple-with-secret-panels','Two panels on the temple open up to reveal hidden treasures.',0,NULL,0,0,NULL,'2009-09-10 05:41:19','2011-11-10 07:28:46'),(3753,NULL,1,'4243 : Pharaoh\'s Temple, rear','4243-pharaohs-temple-rear','The back of the temple is relatively unadorned except for buttons to open up the secret panels and some nice columns.',0,NULL,0,0,NULL,'2009-09-10 05:41:19','2011-11-10 07:28:46'),(3754,NULL,1,'4245 : Warriors (boxed)','4245-warriors-boxed','Five warriors & one horse, and plenty of weapons.',0,NULL,0,0,NULL,'2009-09-10 05:41:19','2011-11-10 07:28:46'),(3755,NULL,1,'4242 : Sphinx, secret panel','4242-sphinx-secret-panel','Turn the key and a secret panel cranks open to reveal whatever treasure you place inside.',0,NULL,0,0,NULL,'2009-09-10 05:46:58','2011-11-10 07:28:46'),(3756,NULL,1,'4340 : Pyramid, eye of Horus','4340-pyramid-eye-of-horus','A very interesting, non-historical addition to the Pyramid set. Actually, more similar to the Eye of Providence found on the US dollar bill.',0,NULL,0,0,NULL,'2009-09-10 05:46:58','2011-11-10 07:28:46'),(3757,NULL,1,'4244 : Chariot ','4244-chariot','--',0,NULL,0,0,NULL,'2009-09-10 05:46:58','2011-11-10 07:28:46'),(3758,NULL,1,'Egyptian sets combined','egyptian-sets-combined-32f7ed','==',0,NULL,0,0,NULL,'2009-09-10 05:48:15','2011-11-10 07:28:46'),(3759,NULL,1,'4246 : Tomb, with tomb raider &amp; camel','4246-tomb-with-tomb-raider-amp-camel','--',0,NULL,0,0,NULL,'2009-09-10 05:48:15','2011-11-10 07:28:46'),(3760,NULL,1,'4242 : Sphinx, with two warriors','4242-sphinx-with-two-warriors','==',0,NULL,0,0,NULL,'2009-09-10 05:48:15','2011-11-10 07:28:46'),(3761,NULL,1,'Canopic Jars','canopic-jars','There are tons of canopic jars throughout the Egypt sets, all fairly accurate! All designed to house a mummy\'s liver, intestines, stomach and lungs!',0,NULL,0,0,NULL,'2009-09-10 05:53:06','2011-11-10 07:28:46'),(3762,NULL,1,'Egyptian sets combined','egyptian-sets-combined-79e028','--',0,NULL,0,0,NULL,'2009-09-10 05:53:06','2011-11-10 07:28:46'),(3763,NULL,1,'4242 : Sphinx skeleton','4242-sphinx-skeleton','Covered in treasure!',0,NULL,0,0,NULL,'2009-09-10 05:53:06','2011-11-10 07:28:46'),(3764,NULL,1,'4246 : Pharaoh\'s Temple','4246-pharaohs-temple','Lots of stickers are applied to this set. The obelisk is especially awesome.',0,NULL,0,0,NULL,'2009-09-10 05:55:32','2011-11-10 07:28:46'),(3765,NULL,1,'4240 : Pyramid stones','4240-pyramid-stones','Very interestingly, the Pyramid set comes with genuine polished stones as treasure!',0,NULL,0,0,NULL,'2009-09-10 05:55:32','2011-11-10 07:28:47'),(3766,NULL,1,'4246 : Tomb with Treasure well','4246-tomb-with-treasure-well','A neat well with rotating parts near the tomb.',0,NULL,0,0,NULL,'2009-09-10 05:55:32','2011-11-10 07:28:47'),(3767,NULL,1,'4340 : Pyramid with rotating door','4340-pyramid-with-rotating-door','The entire front panel slides back, and the door spins around to form a hidden chamber. Canopic jars aplenty!',0,NULL,0,0,NULL,'2009-09-10 05:57:50','2011-11-10 07:28:47'),(3768,NULL,1,'4243 : Pharaoh\'s Temple (boxed)','4243-pharaohs-temple-boxed','Two servants, on pharaoh, secret panels, treasure, and a carryin\' chair!',0,NULL,0,0,NULL,'2009-09-10 05:57:50','2011-11-10 07:28:47'),(3769,NULL,1,'4340 : Pyramid, second floor','4340-pyramid-second-floor','The playset has two levels, and this warrior is poised to protect the second.',0,NULL,0,0,NULL,'2009-09-10 05:57:50','2011-11-10 07:28:47'),(3770,NULL,1,'4340 : Pyramid','4340-pyramid','Unadorned, with one side open.',0,NULL,0,0,NULL,'2009-09-10 05:58:36','2011-11-10 07:28:47'),(3771,NULL,1,'4245 : Warriors','4245-warriors-bace1c','--',0,NULL,0,0,NULL,'2009-09-10 05:58:36','2011-11-10 07:28:47'),(3772,NULL,1,'4242 : Sphinx pieces','4242-sphinx-pieces','--',0,NULL,0,0,NULL,'2009-09-10 05:58:36','2011-11-10 07:28:47'),(3773,NULL,1,'4245 : Warriors pieces','4245-warriors-pieces','--',0,NULL,0,0,NULL,'2009-09-10 05:59:16','2011-11-10 07:28:47'),(3774,NULL,1,'4246 : Tomb with Treasure','4246-tomb-with-treasure','The complete diorama is